INSERT INTO `info_cerdas` VALUES (4, 'Why do we use it ssentially It was popularised in the 1960s', '<p><span style=\"color: rgb(0, 0, 0);\">It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The </span><strong style=\"color: rgb(0, 0, 0);\">point of using Lo</strong><span style=\"color: rgb(0, 0, 0);\">rem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model t</span><strong style=\"color: rgb(0, 0, 0);\">ext, and</strong><span style=\"color: rgb(0, 0, 0);\"> a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).</span></p>', '5321642152225.jpg', '2022-01-14 16:24:04', '74e39e53-cf98-3863-b4cc-d5e439a6ae59');
INSERT INTO `info_cerdas` VALUES (3, 'Where does it come from?', '<p><strong style=\"color: rgb(0, 0, 0);\">Lorem Ipsum</strong><span style=\"color: rgb(0, 0, 0);\">&nbsp;is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.</span></p>', '6701642150554.jpg', '2022-01-14 08:56:04', '59b65863-0603-32c9-bcf7-3c534799811b');
INSERT INTO `info_cerdas` VALUES (5, 'The standard Lorem Ipsum passage, used since the 1500s', '<h3>The standard Lorem Ipsum passage, used since the 1500s</h3><p class=\"ql-align-justify\">\"Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.\"</p><p class=\"ql-align-justify\"><br></p><h3>Section 1.10.32 of \"de Finibus Bonorum et Malorum\", written by Cicero in 45 BC</h3><p class=\"ql-align-justify\">\"Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui ratione voluptatem sequi nesciunt. Neque porro quisquam est, qui dolorem ipsum quia dolor sit amet, consectetur, adipisci velit, sed quia non numquam eius modi tempora incidunt ut labore et dolore magnam aliquam quaerat voluptatem. Ut enim ad minima veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquid ex ea commodi consequatur? Quis autem vel eum iure reprehenderit qui in ea voluptate velit esse quam nihil molestiae consequatur, vel illum qui dolorem eum fugiat quo voluptas nulla pariatur?\"</p><p class=\"ql-align-justify\"><br></p><h3>1914 translation by H. Rackham</h3><p class=\"ql-align-justify\">\"But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful. Nor again is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but because occasionally circumstances occur in which toil and pain can procure him some great pleasure. To take a trivial example, which of us ever undertakes laborious physical exercise, except to obtain some advantage from it? But who has any right to find fault with a man who chooses to enjoy a pleasure that has no annoying consequences, or one who avoids a pain that produces no resultant pleasure?\"</p><p class=\"ql-align-justify\"><br></p><h3>Section 1.10.33 of \"de Finibus Bonorum et Malorum\", written by Cicero in 45 BC</h3><p class=\"ql-align-justify\">\"At vero eos et accusamus et iusto odio dignissimos ducimus qui blanditiis praesentium voluptatum deleniti atque corrupti quos dolores et quas molestias excepturi sint occaecati cupiditate non provident, similique sunt in culpa qui officia deserunt mollitia animi, id est laborum et dolorum fuga. Et harum quidem rerum facilis est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio cumque nihil impedit quo minus id quod maxime placeat facere possimus, omnis voluptas assumenda est, omnis dolor repellendus. Temporibus autem quibusdam et aut officiis debitis aut rerum necessitatibus saepe eveniet ut et voluptates repudiandae sint et molestiae non recusandae. Itaque earum rerum hic tenetur a sapiente delectus, ut aut reiciendis voluptatibus maiores alias consequatur aut perferendis doloribus asperiores repellat.\"</p><h3>1914 translation by H. Rackham</h3><p class=\"ql-align-justify\">\"On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, so blinded by desire, that they cannot foresee the pain and trouble that are bound to ensue; and equal blame belongs to those who fail in their duty through weakness of will, which is the same as saying through shrinking from toil and pain. These cases are perfectly simple and easy to distinguish. In a free hour, when our power of choice is untrammelled and when nothing prevents our being able to do what we like best, every pleasure is to be welcomed and every pain avoided. But in certain circumstances and owing to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated and annoyances accepted. The wise man therefore always holds in these matters to this principle of selection: he rejects pleasures to secure other greater pleasures, or else he endures pains to avoid worse pains.\"</p>', '5991642154105.jpg', '2022-01-14 16:55:26', '8e00773d-fb27-37a4-9428-242de04eedb1');
INSERT INTO `interprestasi_tipologi_jung` VALUES (2, 1, 'ENFJ', 'Si Pendidik', 'Extrovert Intuition Feeling Judging', 'Kamu, pribadi yang senang bergaul dengan orang-orang disekitar maupun yang baru, bersemangat saat berada bersamamereka. Kamu menikmati saat memberikan motivasi serta mampu membuat mereka lebih baik. Kadangkala, kamu banyakkegiatan sehingga membuatmu tidak fokus serta terlalu cepat berespon terhadap sesuatu. Kamu pribadi yang kreatif, unik,memiliki mimpi besar, berpandangan jauh ke depan, senang mempelajari hal-hal baru. Kamu mengerjakan sesuatu secaraacak, percaya pada inspirasi, senang memahami konsep sesuatu. Acapakali, ide yang kamu ceritakan kurang mampudipahami orang, terlalu tinggi cita-cita, bahkan ditantang lingkungan. Kamu mengutamakan kebersamaan/kehangatan/hubungan daripada tujuan kelompok/materi dalam pertemanan. Kamu adalah sahabat yang baikkarena peduli dengan keadaan orang sekitar, serta mampu merasakan apa yang mereka alami. Kamu berusahasemampumu untuk membahagiakan mereka. Kadangkala, kamu rela mengorbakan diri demi orang lain. Kamu adalahpribadi yang rapi, teratur, formal, berusaha untuk tetap waktu sesuai jadwal. Kamu senang membuat berbagaiperencanaan terhadap masa depan sehingga tahu apa yang harus dan tidak harus dilakukan serta berusahamempersiapkannya dengan baik. Kadangkala, kamu terlihat kaku dengan perencanaan maupun pemikiranmu.', 'e6d468e3-840d-3b5e-97fb-382aa1694a6c');
INSERT INTO `interprestasi_tipologi_jung` VALUES (3, 2, 'ENFP', 'Si Pencerah', 'Extrovert Intuition Feeling Perceiving', 'Kamu, pribadi yang senang bergaul dengan orang-orang disekitar maupun yang baru, bersemangat saat berada bersama\r\nmereka. Kamu menikmati saat memberikan motivasi serta mampu membuat mereka lebih baik. Kadangkala, kamu banyak\r\nkegiatan sehingga membuatmu tidak fokus serta terlalu cepat berespon terhadap sesuatu. Kamu pribadi yang kreatif, unik,\r\nmemiliki mimpi besar, berpandangan jauh ke depan, senang mempelajari hal-hal baru. Kamu mengerjakan sesuatu secara\r\nacak, percaya pada inspirasi, senang memahami konsep sesuatu. Acapakali, ide yang kamu ceritakan kurang mampu\r\ndipahami orang, terlalu tinggi cita-cita, bahkan ditantang lingkungan. Kamu mengutamakan\r\nkebersamaan/kehangatan/hubungan daripada tujuan kelompok/materi dalam pertemanan. Kamu adalah sahabat yang baik\r\nkarena peduli dengan keadaan orang sekitar, serta mampu merasakan apa yang mereka alami. Kamu berusaha\r\nsemampumu untuk membahagiakan mereka. Kadangkala, kamu rela mengorbakan diri demi orang lain. Kamu, pribadi yang\r\nfleksibel, santai, siap sedia dalam keadaan apapun, serta tenang dalam menghadapi berbagai persoalan. Kami memiliki\r\nberbagai ide saat menghadapi situasi yang tidak menyenangkan serta kurang mempersalahkan hal yang buruk yang terjadi.\r\nKamu acapkali dinilai telat, tidak rapi, terlalu santai serta kurang perencanaan.', '05f7e6d9-8183-3340-ab0f-d1821156588e');
INSERT INTO `interprestasi_tipologi_jung` VALUES (4, 3, 'ENTJ', 'Si Pemimpin', 'Extrovert Intution Thinking Judging', 'Kamu, pribadi yang senang bergaul dengan orang-orang disekitar maupun yang baru, bersemangat saat berada bersama\r\nmereka. Kamu menikmati saat memberikan motivasi serta mampu membuat mereka lebih baik. Kadangkala, kamu banyak\r\nkegiatan sehingga membuatmu tidak fokus serta terlalu cepat berespon terhadap sesuatu. Kamu pribadi yang kreatif, unik,\r\nmemiliki mimpi besar, berpandangan jauh ke depan, senang mempelajari hal-hal baru. Kamu mengerjakan sesuatu secara\r\nacak, percaya pada inspirasi, senang memahami konsep sesuatu. Acapakali, ide yang kamu ceritakan kurang mampu\r\ndipahami orang, terlalu tinggi cita-cita, bahkan ditantang lingkungan. Kamu, pribadi yang logis dalam menilai sesuatu,\r\nmemikirkan keuntungan di dalam melakukan sesuatu, mementingkan tujuan akhir dari kelompok. Kamu kokoh pendirian\r\nterhadap yang diyakini, melakukan sesuatu sesuai keyakinan serta mencari sumber utama dari permasalahan. Kadangkala,\r\nkamu kurang bisa merasakan apa yang dirasakan orang lain. Kamu adalah pribadi yang rapi, teratur, formal, berusaha untuk\r\ntetap waktu sesuai jadwal. Kamu senang membuat berbagai perencanaan terhadap masa depan sehingga tahu apa yang\r\nharus dan tidak harus dilakukan serta berusaha mempersiapkannya dengan baik. Kadangkala, kamu terlihat kaku dengan\r\nperencanaan maupun pemikiranmu.', 'c974cd0f-7bfd-34e1-908e-2abdae1a28cb');
INSERT INTO `interprestasi_tipologi_jung` VALUES (5, 4, 'ENTP', 'Si Inovator', 'Extrovert Intuition Thinking Perceiving', 'Kamu, pribadi yang senang bergaul dengan orang-orang disekitar maupun yang baru, bersemangat saat berada bersamamereka. Kamu menikmati saat memberikan motivasi serta mampu membuat mereka lebih baik. Kadangkala, kamu banyakkegiatan sehingga membuatmu tidak fokus serta terlalu cepat berespon terhadap sesuatu. Kamu pribadi yang kreatif, unik,memiliki mimpi besar, berpandangan jauh ke depan, senang mempelajari hal-hal baru. Kamu mengerjakan sesuatu secaraacak, percaya pada inspirasi, senang memahami konsep sesuatu. Acapakali, ide yang kamu ceritakan kurang mampudipahami orang, terlalu tinggi cita-cita, bahkan ditantang lingkungan. Kamu, pribadi yang logis dalam menilai sesuatu,memikirkan keuntungan di dalam melakukan sesuatu, mementingkan tujuan akhir dari kelompok. Kamu kokoh pendirianterhadap yang diyakini, melakukan sesuatu sesuai keyakinan serta mencari sumber utama dari permasalahan. Kadangkala,kamu kurang bisa merasakan apa yang dirasakan orang lain. Kamu, pribadi yang fleksibel, santai, siap sedia dalam keadaanapapun, serta tenang dalam menghadapi berbagai persoalan. Kami memiliki berbagai ide saat menghadapi situasi yang tidakmenyenangkan serta kurang mempersalahkan hal yang buruk yang terjadi. Kamu acapkali dinilai telat, tidak rapi, terlalu santaiserta kurang perencanaan.', 'fe3514c8-7072-3e4e-b3cd-9d986979be7b');
INSERT INTO `interprestasi_tipologi_jung` VALUES (6, 5, 'ESFJ', 'Si Perawat', 'Extrovert Sensing Feeling Judging', 'Kamu, pribadi yang senang bergaul dengan orang-orang disekitar maupun yang baru, bersemangat saat berada bersama\r\nmereka. Kamu menikmati saat memberikan motivasi serta mampu membuat mereka lebih baik. Kadangkala, kamu banyak\r\nkegiatan sehingga membuatmu tidak fokus serta terlalu cepat berespon terhadap sesuatu. Kamu adalah pribadi yang\r\nrealitistik terhadap sesuatu, senang sesuatu yang pasti dan telah menjadi kebiasaan. Kamu melakukan sesuatu secara\r\nberurutan, fokus pada masa sekarang, serta percaya pada sesuatu yang kongkrit. Kamu acapkali kurang berani mengambil\r\nrisiko sehingga perkembangan dirimu tidaklah cepat. Kamu mengutamakan kebersamaan/kehangatan/hubungan daripada\r\ntujuan kelompok/materi dalam pertemanan. Kamu adalah sahabat yang baik karena peduli dengan keadaan orang sekitar,\r\nserta mampu merasakan apa yang mereka alami. Kamu berusaha semampumu untuk membahagiakan mereka. Kadangkala,\r\nkamu rela mengorbakan diri demi orang lain. Kamu adalah pribadi yang rapi, teratur, formal, berusaha untuk tetap waktu\r\nsesuai jadwal. Kamu senang membuat berbagai perencanaan terhadap masa depan sehingga tahu apa yang harus dan tidak\r\nharus dilakukan serta berusaha mempersiapkannya dengan baik. Kadangkala, kamu terlihat kaku dengan perencanaan\r\nmaupun pemikiranmu.', '496b0c26-88b6-3a89-9836-bc18776462d6');
INSERT INTO `interprestasi_tipologi_jung` VALUES (7, 6, 'ESFP', 'Si Penghibur', 'Extrovert Sensing Feeling Perceiving', 'Kamu, pribadi yang senang bergaul dengan orang-orang disekitar maupun yang baru, bersemangat saat berada bersama\r\nmereka. Kamu menikmati saat memberikan motivasi serta mampu membuat mereka lebih baik. Kadangkala, kamu banyak\r\nkegiatan sehingga membuatmu tidak fokus serta terlalu cepat berespon terhadap sesuatu. Kamu adalah pribadi yang\r\nrealitistik terhadap sesuatu, senang sesuatu yang pasti dan telah menjadi kebiasaan. Kamu melakukan sesuatu secara\r\nberurutan, fokus pada masa sekarang, serta percaya pada sesuatu yang kongkrit. Kamu acapkali kurang berani mengambil\r\nrisiko sehingga perkembangan dirimu tidaklah cepat. Kamu mengutamakan kebersamaan/kehangatan/hubungan daripada\r\ntujuan kelompok/materi dalam pertemanan. Kamu adalah sahabat yang baik karena peduli dengan keadaan orang sekitar,\r\nserta mampu merasakan apa yang mereka alami. Kamu berusaha semampumu untuk membahagiakan mereka. Kadangkala,\r\nkamu rela mengorbakan diri demi orang lain. Kamu, pribadi yang fleksibel, santai, siap sedia dalam keadaan apapun, serta\r\ntenang dalam menghadapi berbagai persoalan. Kami memiliki berbagai ide saat menghadapi situasi yang tidak menyenangkan\r\nserta kurang mempersalahkan hal yang buruk yang terjadi. Kamu acapkali dinilai telat, tidak rapi, terlalu santai serta kurang\r\nperencanaan.', '0386d40e-0f15-3789-8267-808455f67da2');
INSERT INTO `interprestasi_tipologi_jung` VALUES (8, 7, 'ESTJ', 'Si Pengawas', 'Extrovert Sensing Thinking Judging', 'Kamu, pribadi yang senang bergaul dengan orang-orang disekitar maupun yang baru, bersemangat saat berada bersama\r\nmereka. Kamu menikmati saat memberikan motivasi serta mampu membuat mereka lebih baik. Kadangkala, kamu banyak \r\nkegiatan sehingga membuatmu tidak fokus serta terlalu cepat berespon terhadap sesuatu. Kamu adalah pribadi yang\r\nrealitistik terhadap sesuatu, senang sesuatu yang pasti dan telah menjadi kebiasaan. Kamu melakukan sesuatu secara\r\nberurutan, fokus pada masa sekarang, serta percaya pada sesuatu yang kongkrit. Kamu acapkali kurang berani mengambil\r\nrisiko sehingga perkembangan dirimu tidaklah cepat. Kamu, pribadi yang logis dalam menilai sesuatu, memikirkan\r\nkeuntungan di dalam melakukan sesuatu, mementingkan tujuan akhir dari kelompok. Kamu kokoh pendirian terhadap yang\r\ndiyakini, melakukan sesuatu sesuai keyakinan serta mencari sumber utama dari permasalahan. Kadangkala, kamu kurang\r\nbisa merasakan apa yang dirasakan orang lain. Kamu adalah pribadi yang rapi, teratur, formal, berusaha untuk tetap waktu\r\nsesuai jadwal. Kamu senang membuat berbagai perencanaan terhadap masa depan sehingga tahu apa yang harus dan tidak\r\nharus dilakukan serta berusaha mempersiapkannya dengan baik. Kadangkala, kamu terlihat kaku dengan perencanaan\r\nmaupun pemikiranmu.', '8b28d3af-20bc-3eb4-9b8b-dae97cd2f3fc');
