INSERT INTO `interprestasi_tipologi_jung` VALUES (10, 9, 'INFJ', 'Si Konselor', 'Introvert Intuition Feeling Judging', 'Kami pribadi yang lebih nyaman melakukan sesuatu dalam keadaan tenang, fokus terhadap suatu hal, berpikir/bertindaksecara hati-hati dalam melakukan sesuatu. Kamu senang menjadi pengamat atau pendengar terhadap sesuatu sertamampu meberikan respon yang baik. Kamu cenderung pendiam, lamban berespon, serta fokus hanya satu hal. Kamupribadi yang kreatif, unik, memiliki mimpi besar, berpandangan jauh ke depan, senang mempelajari hal-hal baru. Kamumengerjakan sesuatu secara acak, percaya pada inspirasi, senang memahami konsep sesuatu. Acapakali, ide yang kamuceritakan kurang mampu dipahami orang, terlalu tinggi cita-cita, bahkan ditantang lingkungan. Kamu mengutamakankebersamaan/kehangatan/hubungan daripada tujuan kelompok/materi dalam pertemanan. Kamu adalah sahabat yang baikkarena peduli dengan keadaan orang sekitar, serta mampu merasakan apa yang mereka alami. Kamu berusahasemampumu untuk membahagiakan mereka. Kadangkala, kamu rela mengorbakan diri demi orang lain. Kamu adalahpribadi yang rapi, teratur, formal, berusaha untuk tetap waktu sesuai jadwal. Kamu senang membuat berbagaiperencanaan terhadap masa depan sehingga tahu apa yang harus dan tidak harus dilakukan serta berusahamempersiapkannya dengan baik. Kadangkala, kamu terlihat kaku dengan perencanaan maupun pemikiranmu.', '3256a4cf-4ef5-342a-934f-f97873e4357a');
