INSERT INTO `petunjuk_soal` VALUES (3, 'Carilah Kelanjutan dari Gambar Berikut!', '3de6ca0f-a676-3d9d-b7fb-c6108cee7746', NULL);
INSERT INTO `petunjuk_soal` VALUES (4, 'Carilah Hubungan Kata Melalui Diagram!', '75c3d9f2-d92e-3195-807e-9ce30e865e99', NULL);
INSERT INTO `petunjuk_soal` VALUES (5, 'Carilah Bentuk Kelima dari Gambar Berikut!', '2540166c-9280-38b3-bfb2-bd1f774947d6', NULL);
INSERT INTO `petunjuk_soal` VALUES (6, 'Carilah Berapa Jumlah Kubus Kecil Dalam Bangunan Berikut!', 'fbdc45ff-ef34-34e5-b25c-31c1e06202a1', NULL);
INSERT INTO `petunjuk_soal` VALUES (11, 'NEMTIL A, B, C, D, DAN E MERUPAKAN JAWABAN UNTUK SOAL BERIKUT SUATU BENTUK YANG DAPAT DIBANGUN DENGAN CARA MENYUSUN POTONGAN- POTONGAN YANG TERDAPAT DALAM SOAL!', 'a205d6bb-db26-304a-9064-5495d9c3e53f', NULL);
INSERT INTO `petunjuk_soal` VALUES (8, 'Apabila Jaring-Jaring Bangun Ruang (Bagian Kanan) digabungkan, maka akan menjadi bangun ruang yang mana (Bagian Kiri)?', '57133157-2b10-36f4-afc2-515c3d627a22', NULL);
INSERT INTO `petunjuk_soal` VALUES (9, 'KUBUS A, B, C, D DAN E MERUPAKAN JAWABAN SOAL BERIKUT\r\nKUBUS TERSEBUT  DAPAT  DIPUTAR, DIBALIK, DLL UNTUK MENEMUKAN KESESUAIAN  BENTUKNYA.', '59d8163d-daaa-3afd-9e3b-49734ba6886e', NULL);
INSERT INTO `petunjuk_soal` VALUES (10, 'TERDAPAT LIMA SOAL DI BAGIAN ATAS YANG MENGAMBARKAN HURUF, ANGKA ATAU SIMBOL.  TERDAPAT  LIMA JAWABAN DI  BAGIAN  BAWAH  JUGA. PILIHLAH  JAWABAN\r\nYANG SAMA PERSIS DENGAN SOAL', '2f5b4da2-9d39-3127-ad6a-f4cdabbacaa7', NULL);
INSERT INTO `petunjuk_soal` VALUES (17, 'Pilihlah Salah Satu Jawaban yang Menggambarkan Diri Adik dari (3) Tiga Pilihan', '1c7d4fd8-e8c6-3075-9771-bdb2f27ea23a', 'Peminatan SMA');
INSERT INTO `petunjuk_soal` VALUES (18, 'PILIHLAH SALAH SATU JAWABAN YANG MENGAMBARKAN DIRI ADIK DARI (4) EMPAT PILIHAN.', '6f05f6a5-ba28-30a8-92fa-1b93183bd165', 'Peminatan MAN');
INSERT INTO `petunjuk_soal` VALUES (19, 'SUSUNLAH HURUF-HURUF INI MENJADI SEBUAH KATA YANG MEMILIKI ARTI. KATA TERSEBUT AKAN MEMBENTUK SUATU KELOMPOK KATA TERTENTU. KEMUDIAN, PILIHLAH SATU KATA YANG BERBEDA DARI KELOMPOK TERSEBUT.', '15169115-2161-3eb7-93a7-a3c2815cc725', NULL);
INSERT INTO `petunjuk_soal` VALUES (20, 'Carilah Analogi yang Tepat!', 'ab6012d2-535b-3731-8db7-524658a0afa4', NULL);
INSERT INTO `petunjuk_soal` VALUES (21, 'BACALAH SEMUA PILIHAN JAWABAN DARI A SAMPAI R! PILIHLAH 5 (LIMA) YANG MENGGAMBARKAN DIRI ADIK-ADIK, SERTA URUTKAN PILIHAN TERSEBUT! PILIHAN PERTAMA MERUPAKAN HAL YANG PALING MENGGAMBARKAN DIRI ADIK-ADIK. PILIHAN KEDUA, MERUPAKAN URUTAN KEDUA YANG MENGGAMBARKAN DIRI ADIK-ADIK, DST.', 'cc56738a-d487-3857-856d-88b6e56fa92a', NULL);
INSERT INTO `petunjuk_soal` VALUES (22, 'Carilah Kelanjutkan dari Deretan Angka Berikut!', '10758038-bf85-328f-ae6f-e92142b05912', NULL);
INSERT INTO `petunjuk_soal` VALUES (23, 'TUGAS ANDA ADALAH MEMBACA SEMUA PILIHAN TERSEBUT. PILIHLAH 7 PILIHAN YANG MENGAMBARKAN DIRI ANDA, RANKING PILIHAN TERSEBUT DARI 1 S.D. 7. NOMOR 1 MENUNJUKKAN HAL YANG PALING DISENANGI, NOMOR 2 MENUNJUKKAN NOMOR DUA YANG DISENANGI, DST SAMPAI NOMOR 7.', 'd649c06e-f0a2-34c0-bd19-9a35f65e61ac', NULL);
INSERT INTO `petunjuk_soal` VALUES (24, 'PILIHLAH SALAH SATU JAWABAN YANG SESUAI DIRI ANDA, A ATAU B.', '07e40400-5727-3ec9-a767-44f5c98ae9cc', NULL);
