INSERT INTO `quiz_sesi_master` VALUES (9, 'SIKAP_TERHADAP_PELAJARAN', 'SIKAP TERHADAP PELAJARAN', '/soal-sikap-pelajaran', 'RT', 10, '<p><span>Anda diminta untuk memberikan tanggapan terhadap pelajaran tertentu. Terdapat tiga kontinum kata sifat yang bertolak belakang dari 1 s.d. 7 sesuai dengan jumlah bintang yang diberikan.<br /></span></p>', 'skoring_sikap_pelajaran', '50b80112-d1c1-3acb-ac39-897b666bc063');
INSERT INTO `quiz_sesi_master` VALUES (10, 'SKALA_TES_MINAT_INDONESIA', 'TES MINAT INDONESIA', '/soal-tmi', 'TOP', 7, '<p><span>Bacalah semua pilihan jawaban dari 1 sampai 99!. Pilihlah <strong>7 (tujuh)</strong> yang menggambarkan<br />diri anda,&nbsp; serta urutkan pilihan tersebut! Pilihan pertama merupakan hal yang paling<br />menggambarkan diri anda Pilihan kedua, merupakan urutan kedua yang<br />menggambarkan diri anda, dst.</span></p>', 'skoring_minat_tmi', 'a54e05d7-cddf-3dbe-a9f3-76cebe0fd9e3');
INSERT INTO `quiz_sesi_master` VALUES (11, 'SKALA_TES_KARAKTERISTIK_PRIBADI', 'TES KARAKTERISTIK PRIBADI', '/soal-tes-karakteristik-pribadi', 'PG', 60, '<p>Pilihlah salah satu jawaban yang menggambarkan diri anda dari (4) Empat pilihan yang ada!</p>', 'skoring_karakteristik_pribadi', '7c0004c6-4e44-3d78-8827-09e7339f034d');
INSERT INTO `quiz_sesi_master` VALUES (12, 'SKALA_TES_TIPOLOGI_JUNG', 'TES MBTI', '/soal-tipologi-jung', 'PG', 60, '<p>Pilihlah salah satu jawaban yang menggambarkan diri anda dari (2) Dua pilihan yang ada!</p>', 'skoring_tipologi_jung', '60fddb73-7202-3968-b5d3-9a72e808ea23');
INSERT INTO `quiz_sesi_master` VALUES (13, 'SKALA_PEMINATAN_SMK', 'TES PEMINATAN SMK', '/soal-skala-peminatan-smk', 'TOP', 5, '<p>Bacalah semua pilihan jawaban dari A sampai Q!. Pilihlah <strong>5 (lima)</strong> yang menggambarkan</p><p>diri anda,&nbsp;serta urutkan pilihan tersebut! Pilihan pertama merupakan hal yang paling</p><p>menggambarkan diri anda Pilihan kedua, merupakan urutan kedua yang</p><p>menggambarkan diri anda, dst.</p><ul><li>Klik Tombol <strong>[+ Pilihan]&nbsp;</strong>kemudian klik nomor yang akan dipilih, lanjutkan dengan tekan tombol <strong>Pilih</strong></li><li>Anda dapat menghapus pilihan dengan klik (tekan) pilihan kemudian klik tombol <strong>Hapus</strong>.</li><li>Anda juga dapat mengubah urutan pilihan dengan <em>drag</em> dan<em> drop</em> (seret dan lepas) pilihan yang sudah ditambahkan.</li></ul>', 'skoring_minat_smk', '35163cd9-e996-385f-8366-fe493177e51f');
INSERT INTO `quiz_sesi_master` VALUES (17, 'BREAK', 'ISTIRAHAT / BREAK', '/soal-break', 'BREAK', 1, '<p>Selama Sesi Break Mohon Untuk Tidak Keluar Dari Aplikasi. Terima Kasih!</p>', NULL, '907d230c-69cf-38a3-8ebb-1acf6a7262c0');
