INSERT INTO `quiz_template_saran` VALUES (1, 'Peminatan SMA', 'skoring-minat-sma', '<p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">HASIL KARAKTERISTIK PRIBADI</strong></p><ul><li><span style=\"background-color: transparent;\">Jika klasifikasi </span><strong style=\"background-color: transparent;\">Sangat Rendah, </strong><span style=\"background-color: transparent;\">adik disarankan untuk </span><em style=\"background-color: transparent;\">memperbaikinya</em><span style=\"background-color: transparent;\">.</span></li><li><span style=\"background-color: transparent;\">Jika klasifikasi </span><strong style=\"background-color: transparent;\">Rendah, </strong><span style=\"background-color: transparent;\">adik disarankan untuk </span><em style=\"background-color: transparent;\">meningkatkannya</em><span style=\"background-color: transparent;\">.</span></li><li><span style=\"background-color: transparent;\">Jika klasifikasi </span><strong style=\"background-color: transparent;\">Sedang, </strong><span style=\"background-color: transparent;\">adik disarankan untuk </span><em style=\"background-color: transparent;\">mempertahankannya</em><span style=\"background-color: transparent;\">, boleh ditingkatkan sedikit.</span></li><li><span style=\"background-color: transparent;\">Jika klasifikasi </span><strong style=\"background-color: transparent;\">Tinggi, </strong><span style=\"background-color: transparent;\">adik disarankan untuk mempertahakannya, tidak perlu ditingkatkan, diturunkan sedikit boleh.</span></li><li><span style=\"background-color: transparent;\">Jika klasifikasi </span><strong style=\"background-color: transparent;\">Sangat Tinggi, </strong><span style=\"background-color: transparent;\">adik disarankan untuk menurunkannya, hal yang tidaklah terlalu bagus.</span></li></ul><p><em style=\"background-color: transparent; color: rgb(0, 0, 0);\">Adik dapat berkonsultasi ke konselor atau psikolog terdekat untuk lebih mendalam.</em></p><p><br></p><p><br></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">SARAN PENGEMBANGAN DIRI DARI KEPRIBADIAN</strong></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Hasil </span><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">Karakteristik pribadi</strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\"> adik adalah sesuatu sifatnya mampu diubah seiring kesadaran diri dan keinginan untuk menjadi lebih baik. Adik perlu memperhatikan </span><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">tipologi kepribadian</strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">, kepribadian tersebut merupakan pola relatif menetap di dalam diri. Pengetahuan kepribadian tersebut bisa membuat adik hidup dengan menjadi diri sendiri.&nbsp; Ia menjelaskan tentang deskripsi diri, kekuatan dan kelemahan, cara berkomunikasi, cara menghadapi permasalahan, situasi pekerjaan yang sesuai, dll. Informasi tersebut dapat dilihat di internet sesuai nama tipologi kepribadian adik.</span></p><p><br></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">MINAT JURUSAN KULIAH</strong></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Informasi saat ini adalah tentang minat adik terhadap jurusan kuliah di Indonesia yang adik tempuh setelah SMA. Minat bisa berubah selama proses pendidikan tiga tahun, perlu lagi tes selanjutnya waktu kelas XII. Informasi ini dapat digunakan untuk gambaran sederhana tentang jurusan kuliah ataupun pengembangan minat bakat adik.&nbsp;</span></p><p><br></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">SIKAP TERHADAP PELAJARAN</strong></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Pandangan positif atau negatif terhadap pelajaran di sekolah.&nbsp; Sikap terhadap pelajaran dijadikan salah satu dasar penentuan peminatan di SMA, bisa dijadikan dasar dalam memilih jurusan kuliah kelak. Beberapa jurusan menghendaki ilmu dasar dari pelajaran SMA. Jurusan </span><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">Kedokteran</strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\"> misalnya, berasal dari pelajaran </span><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">Biologi. </strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Sikap </span><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">positif </strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">menandakan adik menyenangi pelajaran tersebut. Belajar pelajaran tersebut sangat adik tunggu-tunggu di sekolah sebab menjadi hal yang menggembirakan. Pelajaran tersebut adik nilai “penting dan bermanfaat” bagi kehidupan. Materinya dirasa&nbsp; “mudah,&nbsp; ringan, dan sederhana”. </span><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">Adik bisa memiliki nilai yang baik di pelajaran ini. Sikap negatif </strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">&nbsp;menandakan adik tidak menyenangi pelajaran tersebut. Adik kerap kali menghindari pelajaran tersebut di&nbsp; sekolah. Juga, hal yang membosankan bagi adik saat berada di kelas tersebut.&nbsp; Pelajaran tersebut adik nilai “tidak penting dan tidak bermanfaat” bagi kehidupan. Materinya dirasa&nbsp; “sulit, berat, dan komplet\'’. </span><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">Adik bisa memiliki nilai yang tidak baik di pelajaran ini.</strong></p><p><br></p><p><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">HASIL TES KOGNITIF</strong></p><ul><li class=\"ql-align-justify\"><em style=\"background-color: transparent;\">Informasi Umum</em><span style=\"background-color: transparent;\"> = pengetahuan terhadap informasi umum dikenal luas dan hangat yang sedang beredar.</span></li><li class=\"ql-align-justify\"><em style=\"background-color: transparent;\">Penalaran Verbal</em><span style=\"background-color: transparent;\"> = penalaran terhadap stimulus berkaitan kata, bahasa, kalimat, analogi, pengertian. Bakat ini berguna untuk menalar informasi/pekerjaan berhubungan dengan komunikasi verbal/pembuatan makalah (</span><em style=\"background-color: transparent;\">paper</em><span style=\"background-color: transparent;\">).</span></li><li class=\"ql-align-justify\"><em style=\"background-color: transparent;\">Penalaran Kuantitatif</em><span style=\"background-color: transparent;\"> = penalaran terhadap stimulus angka, bilangan, himpunan, sudut, hitungan sederhana. Bakat ini berguna dengan pekerjaan hitungan atau jurusan kuliah yang banyak membutuhkan hitungan.</span></li><li class=\"ql-align-justify\"><em style=\"background-color: transparent;\">Penalaran Abstrak</em><span style=\"background-color: transparent;\"> = penalaran terhadap stimulus gambar, simbol, tanda, dll. Bakat ini berguna untuk menalar hal bersifat abstrak, seperti proses suatu zat, perkembangan suatu benda, arah suatu benda, dll.</span></li><li class=\"ql-align-justify\"><em style=\"background-color: transparent;\">Penalaran Spasial</em><span style=\"background-color: transparent;\"> = penalaran terkait pola dua atau tiga dimensi dari suatu simbol bangunan. Bakat ini berguna untuk membuat suatu&nbsp; sketsa, gambar, bangunan, kuliah di jurusan Teknik Sipil/Arsitekstur.</span></li><li class=\"ql-align-justify\"><em style=\"background-color: transparent;\">Pengertian Mekanika</em><span style=\"background-color: transparent;\"> = penalaran stimulus fungsi mekanik/fisika sederhana. Bakat ini berguna untuk mendesain suatu mesin. Alat yang berhubungan bagi kehidupan ataupun kuliah Teknik Mesin/Elektro/Fisika.</span></li><li class=\"ql-align-justify\"><em style=\"background-color: transparent;\">Cepat Teliti</em><span style=\"background-color: transparent;\"> = kemampuan memperhatikan detail dalam melakukan suatu pekerjaan rutin. Bakat berguna untuk pekerjaan yang terkait dengan ketelitian, misalnya eskperimen di laboratorium.</span></li><li class=\"ql-align-justify\"><strong style=\"background-color: transparent;\"><em>Skor IQ Konversi </em></strong><span style=\"background-color: transparent;\">merupakan penjumlahan dari 7 jenis&nbsp; bakat kognitif, yang kemudian dikonversi menjadi Skor IQ terstandardisasi Wechsler Mean=100 dan SD=15.&nbsp; IQ ≥ 130 = very superior/jenius; IQ 120 s.d. 129 = superior/cerdas; IQ 110 s.d. 119 = Di Atas Rata-Rata; IQ 90 s.d. 109 = Rata-Rata; IQ 80 s.d. 89 = Di Bawah Rata-Rata; IQ 70 s.d. 79 = Batas Ambang (</span><em style=\"background-color: transparent;\">boderline</em><span style=\"background-color: transparent;\">) dan IQ &lt;70 (defiensi mental).</span></li></ul><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Kemampuan kognitif membantu dalam proses pembelajaran, di mana siswa cenderung mudah memahami pelajaran dan bisa memiliki nilai yang baik. Hal tersebut terjadi saat siswa memiliki motivasi belajar yang baik dan regulasi emosi/diri yang bagus. Bagi anak yang skor/klasifikasi </span><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">tidak tinggi,</strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\"> masih memiliki kesempatan besar untuk berhasil asalkan </span><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">motivasi belajar dan regulasi emosi diperkuat</strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">. Keberhasilan masa depan lebih disebabkan oleh motivasi yang baik serta regulasi emosi/diri yang bagus.</span></p><p><br></p>', '2fa027c8-99f5-3d49-b25d-aaab4fd77b1f');
