INSERT INTO `ref_komponen_karakteristik_pribadi` VALUES (5, 'Keyakinan Diri', 'Keyakinan akan kemampuan dirinya mampu melakukan berbagai\r\ntugas yang akan dihadapi pada masa akan datang baik itu pembelajaran,\r\norganisasi maupun hubungan', 'pribadi_yakin', '4847678a-73fb-3b6f-9db5-6acd6479bb68');
INSERT INTO `ref_komponen_karakteristik_pribadi` VALUES (2, 'Motivasi Belajar', 'Keinginan memiliki nilai terbaik dan memahami materi pelajaran\r\nlebih dari teman-teman atau standar materi yang diajarkan sehingga mengeluarkan\r\nbanyak usaha.', 'pribadi_motivasi', '4e740d91-d0ab-3b79-ba0f-7c9ded8604d1');
INSERT INTO `ref_komponen_karakteristik_pribadi` VALUES (4, 'Daya Juang', 'Keinginan untuk tetap mendapatkan apa yang dicita-citakan,\r\nwalaupun berhadapan dengan banyak rintangan yang menghadang sehingga terus\r\nmengejar cita-citanya.', 'pribadi_juang', '52e1168f-7cf4-3d89-bf2c-60b42f88dba6');
INSERT INTO `ref_komponen_karakteristik_pribadi` VALUES (6, 'Kepercayaan Diri', 'Kepercayaan akan keputusan yang ia ambil sehingga tidak\r\nmudah untuk digoyangkan, walaupun banyak lingkungan mencemooh.', 'pribadi_percaya', '48649503-c6fb-30c7-a520-4bae9909bb5b');
INSERT INTO `ref_komponen_karakteristik_pribadi` VALUES (7, 'Konsep Diri', 'Penilaian positif atau negatif terhadap diri baik fisik, kecerdasan,\r\npenampilan, maupun keluarga.', 'peribadi_konsep', '81e01549-f8ec-3323-a13e-5bb96d95b304');
INSERT INTO `ref_komponen_karakteristik_pribadi` VALUES (8, 'Potensi Kreativitas', 'Keterampilan untuk menciptakan sesuatu yang berbeda,\r\nunik, menarik dan bermanfaat sehingga mampu membuat sesuatu menjadi lebih\r\nefektif dan efisien', 'pribadi_kreativitas', '1944a0b1-82e8-3a95-9f11-3c73952ce124');
INSERT INTO `ref_komponen_karakteristik_pribadi` VALUES (9, 'Potensi Kepemimpinan', 'Keterampilan untuk membuat visi dan misi masa depan\r\nserta mampu menggerakan lingkungan sekitar untuk mendapatkan visi misi\r\nbersama tersebut', 'pribadi_mimpin', '66900bbe-7f7e-39ad-8a1c-c5ff67b761cd');
INSERT INTO `ref_komponen_karakteristik_pribadi` VALUES (10, 'Jiwa Entrepreneur', 'Keterampilan untuk mengubah sesuatu di lingkungan\r\nsehingga mampu menciptakan sesuatu yang bernilai lebih, bernilai jual maupun\r\nmenghasilkan pendapatan', 'pribadi_entrepreneur', 'af749367-149b-3809-a19e-08af6438be99');
INSERT INTO `ref_komponen_karakteristik_pribadi` VALUES (11, 'Daya Tahan Stress', 'Kemampuan untuk mengantisipasi permasalahan yang\r\nmungkin terjadi nanti sehingga tetap bisa beraktivitas dengan baik, walaupun\r\nmungkin ada banyak permasalahan', 'pribadi_stress', 'c0796fee-11d0-3d9e-8d8e-6be652474baa');
INSERT INTO `ref_komponen_karakteristik_pribadi` VALUES (12, 'Regulasi Emosi', 'Keterampilan untuk mengelola diri (emosi) saat berhadapan\r\ndengan situasi yang tidak menyenangkan sehingga mampu bertindak tenang dan\r\nkonstruktif.', 'pribadi_emosi', '8a1d692d-1131-3caf-a4e9-4df5a2d15ce5');
INSERT INTO `ref_komponen_karakteristik_pribadi` VALUES (13, 'Keterampilan Sosial', 'Kemampuan untuk membina hubungan baik dengan\r\nbanyak orang di berbagai situasi dan dari berbagai kalangan sehingga terciptanya\r\nhubungan yang harmonis', 'pribadi_sosial', 'e124d921-b563-3f44-a16c-107dee557174');
INSERT INTO `ref_komponen_karakteristik_pribadi` VALUES (14, 'Empati', 'Kemampuan untuk merasakan apa yang dipikirkan, dirasakan dan dialami\r\noleh orang lain serta tergerak untuk membantu orang tersebut dengan tanpa\r\npamrih', 'pribadi_empati', 'beb42e71-763f-3f30-9cb0-fed4e0056745');
