INSERT INTO `soal_karakteristik_pribadi` VALUES (7, 2, 1, '<strong>Saat hari libur pun, saya belajar dengan senang hati</strong>', '0111e19d-ac2e-35fc-8fd7-f0eb39d1969a', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (9, 4, 2, '<strong>Saya menyukai seseorang (lawan jenis) yang sudah memiliki kekasih.</strong> Namun, saya nekat menyatakan isi hati padanya meskipun tahu akan ditolak.', '6341da9c-16a8-39d1-ac93-13e0cc469aa3', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (10, 5, 3, '<strong>Kelompok kami telah selesai mengerjakan tugas.</strong> Saya mengajak teman-teman untuk presentasi duluan walaupun belum ada kelompok lain yang maju.', '4b5082fb-9361-3442-827e-79d42b9b4622', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (11, 6, 4, '<strong>Saat menghadiri suatu acara, saya menggunakan pakaian yang tidak sesuai dengan tema acara tersebut. Saya</strong> merasa biasa saja (tidak masalah).', '3d5f65a3-5808-3e56-8d6b-0686a24ffd8d', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (12, 7, 5, '<strong>Dalam lingkup pertemanan, saya adalah orang yang</strong> lebih pintar dari sebagian besar teman saya.', '4280a6dc-1d43-37df-b60b-c2d32fffe086', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (13, 8, 6, '<strong>Saat menghadapi suatu permasalahan, saya lebih senang mencoba mengatasinya dengan</strong> cara baru walaupun ada kemungkinan gagal.', '360efc93-7cdb-361a-8f95-16ef978d72a9', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (14, 9, 7, '<strong>Bulan depan, ada beberapa hari libur. Maka,</strong> Saya berencana mengajak teman-teman berlibur ke sebuah tempat', 'f031c12b-66fd-37ff-af42-40f0a7f484c9', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (15, 10, 8, '<strong>Saya senang berjualan</strong> untuk menghasilkan pendapatan.', '6ae6849d-938c-342a-9c7d-df1c5c014f00', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (16, 11, 9, '<strong>Saya datang ke acara tepat waktu, namun peserta yang lain belum datang. Sikap saya adalah biasa saja dan tidak merasa kesal dengan mereka.</strong>', '8da86504-3dc2-36d3-b39e-7fc987d9731b', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (17, 12, 10, '<strong>Saat menghadapi suatu permasalahan, saya</strong> tetap semangat beraktivitas seperti biasanya, <strong>tidak </strong>sampai merasa sedih.', '7755b976-fa72-36b6-a56d-1e535daf08b3', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (18, 13, 11, '<strong>Saat baru berkenalan dengan seseorang, saya</strong> bisa mengakrabkan diri dengan mudah.', '70279701-c49a-3ab7-a7d9-68aca9432f98', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (19, 14, 12, '<strong>Saat tugas utama saya sudah selesai, saya</strong> membantu teman mengerjakan tugasnya walaupun saya ada tugas yang lain lagi.', '41e49e7e-156c-3db8-8ace-f871ec257efa', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (20, 2, 13, '<strong>Saya merasa materi yang disampaikan oleh guru di kelas</strong> belum cukup dan perlu dipelajari lagi secara mandiri.', '395c9a0e-7174-35d8-8ae5-3335e7dc5e3d', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (21, 4, 14, '<strong>Dalam mengadakan suatu acara, saya lebih senang diberikan dana terbatas</strong> sehingga bisa mencari sendiri dana tambahan.', '58e98ce6-d6b7-3cef-8856-b1b0c9554a76', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (22, 5, 15, '<strong>Sikap saya ketika diminta untuk menjadi ketua panitia suatu kegiatan kelas, saya siap</strong> bersedia menerima dengan senang hati.', '432b2462-ce6c-3a98-afa9-fe43a0e6571d', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (23, 6, 16, 'Dalam suatu diskusi, saya senang memberikan pendapat lain yang kadangkala kontroversial.', '9745cad7-0c3f-3bce-b8ad-956526d88de7', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (24, 7, 17, '<strong>Menurut saya,</strong> penampilan saya lebih menarik daripada sebagian besar teman-teman di sekitar saya', 'f9d8159c-460f-3261-8d4a-b134452686bc', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (25, 8, 18, '<strong>Ketika diminta membuat sebuah acara sekolah, saya senang mengusulkan kegiatan yang</strong> belum pernah dilaksanakan walaupun belum tentu disukai', '8204168f-3163-3874-bc2e-73d36892195a', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (26, 9, 19, '<strong>Saya </strong>senang memikirkan cara mengubah lingkungan menjadi lebih baik dan efektif. Sampai terkadang, saya lupa/tidak fokus pada kegiatan yang saya lakukan saat ini.', '8b76ed05-d626-3e10-8cba-0b9fca89bc7d', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (27, 10, 20, '<strong>Pada hari libur, saya senang</strong> bekerja menghasilkan uang daripada menghabiskan waktu untuk kegiatan lain', '6f3d36d8-39b0-315b-8290-cfc6b4985c83', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (28, 11, 21, '<strong>Seorang teman menceritakan kekurangan saya, padahal kekurangan tersebut tidak benar adanya. Sikap saya</strong> tidak mempersoalkannya/tertawa kecil dalam hati.&nbsp;', '523e50cf-b0e8-3937-9d9c-63b7fff57173', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (29, 12, 22, '<strong> Orang tua saya sedang mengalami masalah keuangan, namun saya </strong>tetap bisa fokus ke kegiatan saya <strong>tanpa </strong>memikirkan hal tersebut.', '82b2a235-7d17-3c2a-adff-0fe464c79d68', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (30, 13, 23, '<strong>Saat menghadiri suatu acara, saya tidak mengenal seorang pun. Maka, saya langsung</strong> mencari seseorang untuk diajak ngobrol.', '1b3028c3-10d5-334a-a8c9-aa45b2a8d348', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (31, 14, 24, '<strong>Saat teman menceritakan kisah sedih yang dialaminya, saya</strong> bisa merasakannya dengan mudah.', '35c9e9ca-e5a0-33e4-8a07-390ddb6092bb', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (32, 2, 25, '<strong>Saat diberikan tugas oleh guru di kelas, saya</strong> merasa senang sekali.', '6a75e2ee-1464-383a-a480-a4c0f01cb63d', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (33, 4, 26, '<strong>Orang lain menilai saya memiliki cita-cita</strong> yang tinggi, sulit dicapai, dan hanya sedikit orang yang bisa meraihnya.', 'c99e886d-ec60-3a12-b88f-a9548eac700a', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (34, 5, 27, '<strong>Ketika bertanding, saya memilih untuk melawan orang yang</strong> lebih hebat dari saya walaupun belum tentu menang.&nbsp;', '5e8f8a00-48d1-398f-8f80-a16d0b153161', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (35, 6, 28, '<strong>Dalam kehidupan sehari-hari, saya lebih</strong> senang dikritik oleh orang lain daripada dipuji', '691128b1-5a78-3ee9-b175-1eb15fba4a65', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (36, 7, 29, '<strong>Menurut saya,</strong> saya lebih beruntung daripada sebagian besar anggota keluarga saya di rumah', 'dbd81092-0466-3a88-8874-d0d97e2c310e', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (37, 8, 30, '<strong>Ketika ditraktir teman yang berulang tahun, saya akan memesan makanan yang</strong> belum pernah saya coba sebelumnya.', '2400cd47-ca1a-32c7-af0d-63bf5b3eb198', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (38, 9, 31, '<strong>Saat kami diberi makanan oleh orang lain, sikap saya adalah </strong>memberikan teman terlebih dahulu, bagian saya yang terakhir saja.', 'b27cb014-10ab-3c97-849a-b48cdcd1c884', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (39, 10, 32, '<strong>Saat membeli suatu barang, saya</strong> ada keinginan untuk menjualnya lagi ke orang lain', '7c4a30ab-e71d-3967-95e6-423dac4b3af0', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (40, 11, 33, '<strong>Apa yang saya rencanakan tidak sesuai rencana. Sikap saya adalah</strong> menerima dengan lapang dada (tidak stres dan tidak merasa masalah).', '0ef86160-3620-3253-b347-59fbc79a42a0', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (41, 12, 34, '<strong>Ketika ada banyak tugas yang harus dilakukan Minggu ini, saya</strong> masih tetap bisa bercanda dengan teman-teman tanpa memikirkan tugas tersebut', '125057b7-b132-3e1b-b3be-07479ca69957', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (42, 13, 35, '<strong>Ketika ada seseorang di dekat saya yang belum saya kenal, saya </strong>menghampirinya untuk memperkenalkan diri.', '12ae2d37-a65d-3643-b7ad-b9d3e6b7b711', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (43, 14, 36, '<strong>Saat melihat ekspresi wajah orang lain, saya</strong> bisa mengetahui apakah perasaan orang tersebut sedang bahagia, bersedih, atau biasa saja.', 'a06fb28a-0176-3398-aa26-ec097015978b', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (44, 2, 37, '<strong>Saya senang membaca materi pelajaran</strong> yang belum pernah diajarkan di kelas.', '1c2b5a36-0f4d-33c6-91e9-04bdd1b141bb', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (45, 4, 38, '<strong>Saat melihat orang lain sukses, saya merasa bahwa saya bisa</strong> lebih hebat darinya', '3b96e2bb-7921-36fd-8dfa-e25b97d01417', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (46, 5, 39, '<strong>Ketika diminta untuk membujuk orang yang susah/keras kepala demi suatu kegiatan, saya mau</strong> memenuhi permintaan tersebut.', 'f03a69e9-83f3-31c8-98e9-0f68d6f3bc4e', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (47, 6, 40, '<strong>Ketika teman-teman menertawakan penampilan saya pada sebuah pentas di kelas, saya merasa biasa saja/tidak masalah/santai saja.</strong>', '09584af4-dffa-3291-a365-e210ca5147dd', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (48, 7, 41, '<strong>Dalam bergaul, saya </strong>merasa lebih mudah bergaul daripada sebagian besar orang-orang di sekitar saya', 'b0018f64-425a-305f-9af9-b29f870aed83', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (49, 8, 42, '<strong>Saat guru menjelaskan pelajaran, saya lebih suka</strong> menuangkan suatu ide di buku catatan daripada mencatat materi pelajaran.', '0a311e68-84a2-38ed-94d1-7f65fbe58cb8', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (50, 9, 43, '<strong>Saya senang </strong>terlibat aktif<strong> </strong>dalam suatu kegiatan/organisasi.', 'ed86b768-4785-37d6-b3c4-1e226b9f37e2', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (51, 10, 44, '<strong>Saya diminta menjadi bagian tim yang mencari dana suatu kegiatan. Maka, saya </strong>bersedia dengan senang hati', '95fbaba7-76c0-3b29-8a3b-3e835d998214', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (52, 11, 45, '<strong>Saya tidak lulus masuk ke sekolah yang saya impikan. Sikap saya adalah</strong> biasa saja/tidak sedih/santai Saja.', 'ffaac69d-7995-3c22-b5ad-43d1cf08a225', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (53, 12, 46, '<strong>Ada beberapa janji yang belum saya tepati. Saya merasa</strong> biasa saja, tidak usah dipikirkan dan biarkan saja', 'ac7de87f-05e0-3495-8708-0abdb4fdd0e9', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (54, 13, 47, '<strong>Teman saya pulang menjuarai suatu kompetisi. Meskipun dia berada jauh dari saya, saya langsung</strong> mendatanginya untuk mengucapkan selamat', '7d80ae65-b8cb-3ee7-ab4f-228047172975', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (55, 14, 48, '<strong>Ada teman yang ingin menceritakan isi hatinya kepada saya, padahal saya sedang ada pekerjaan lain. Sikap saya adalah</strong> siap sedia mendengarkan isi hati teman dengan segera.', '2ab77e62-88aa-3657-8a94-ca7b3b37b4ba', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (56, 2, 49, '<strong>Ketika saya mendapatkan nilai 80 di suatu ujian, saya sebenarnya </strong>belum merasa puas.', '1516a09d-2315-3255-b24e-147b8ec76390', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (57, 4, 50, '<strong>Saya ingin menjadi yang terbaik</strong> di antara teman-teman lain dalam berbagai bidang.', '78f604ff-7b94-3442-b998-a03062959794', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (58, 5, 51, '<strong>Saat mengerjakan tugas sekolah, saya memilih bekerja sama dengan anak-anak nakal/bandel karena mereka lebih mengasyikkan.</strong>', 'b01874fa-7570-3932-9882-0719369d6b0c', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (59, 6, 52, '<strong>Dalam mengambil keputusan, saya</strong> yakin dengan keputusan yang saya buat tanpa meminta saran dari orang lain.', '9a6d82e2-771c-3e5b-a627-3b851f1c1c10', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (60, 7, 53, '<strong>Saya lebih taat beribadah</strong> daripada teman-teman yang saya kenal.', 'f6aa0932-f274-38d4-af91-5ba0134b4328', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (61, 8, 54, '<strong>Saya akan mengunjungi rumah keluarga di suatu tempat tanpa ada hal yang mendesak sehingga bisa santai. Saya pun</strong> mencoba jalur lain walaupun tidak tahu dengan jelas', 'b9103ea5-030f-39dd-be2e-56a9fb067b92', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (62, 9, 55, '<strong>Saya memilih untuk </strong>membangun sebuah usaha kecil daripada menjadi karyawan di suatu tempat.', '3470f3b4-7c79-30f6-83de-a9fcd334646c', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (63, 10, 56, '<strong>Saya senang mendengarkan topik yang berkaitan dengan bisnis melalui media sosial</strong>, seperti youtube, google, dan instagram.&nbsp;', '1d381249-0682-3c07-8b1e-805bcf26e86f', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (64, 11, 57, '<strong>Teman-teman melanggar kesepakatan yang telah kami buat, sedangkan saya melakukan hal yang telah kami sepakati</strong>. Sikap saya menerima dengan santai tanpa merasa risih.', '99caa87a-eb90-3e85-b422-96bc6bd4d633', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (65, 12, 58, '<strong>Saya sepertinya akan menghadapi suatu permasalahan bulan depan. Solusinya akan saya pikirkan saat menghadapinya nanti, bukan dari sekarang.</strong>', 'de14b336-7290-3a45-845b-b06fe68f6ccd', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
INSERT INTO `soal_karakteristik_pribadi` VALUES (66, 13, 59, '<strong>Kami sedang membuat suatu kegiatan. Saya lebih senang menjadi tim</strong> yang bertemu dengan orang-orang (hubungan masyarakat).', 'f041cfc8-af00-3361-9d93-130f2c300cfc', 'Tidak Sesuai', 'Agak Tidak Sesuai', 'Agak Sesuai', 'Sesuai');
