INSERT INTO `soal_peminatan_man` VALUES (1, 1, '<p class=\"ql-align-justify\">Sekolah kami mengadakan perkemahan di sebuah desa yang asri. Di waktu istirahat, kami dipersilakan untuk melakukan <strong>aktivitas bebas. </strong>Saya …', 'Melihat pemandangan alam yang mengagumkan.', 'Mendekati beberapa warga untuk berkenalan.', 'Mempelajari beberapa percakapan umum penduduk.', 'Mendatangi tempat pengajian Al-Quran untuk melihat anak-anak.', '1a9e86d0-8354-3d09-973b-42c7272973fc');
INSERT INTO `soal_peminatan_man` VALUES (3, 2, '<p class=\"ql-align-justify\">Di masa yang akan datang, saya bermimpi menjadi <strong>orang yang sukses </strong>dalam hal tertentu. Saya berharap dapat …<br>', 'Menjadi ahli pada suatu bidang tertentu.', 'Menjadi kepala/manajer suatu perusahaan/instansi.', 'Bisa keliling ke beberapa negara.', 'Menjadi ustaz yang berceramah beberapa tempat/daerah.', '3a841f35-c89c-3425-a224-061c9a1e74cb');
INSERT INTO `soal_peminatan_man` VALUES (4, 3, '<p class=\"ql-align-justify\">Paman memberi uang sebesar <strong>Rp200.000,00 </strong>kepada saya. Saya mempunyai ide untuk membeli buku yang bermanfaat, yaitu …<br>', 'Buku tentang ekosistem hayati tertentu.', 'Buku keberagaman adat Indonesia.', 'Kamus bahasa tertentu.', 'Buku agama tentang masalah populer.', '990ad3fc-58d1-322d-85a4-f22cc1202277');
INSERT INTO `soal_peminatan_man` VALUES (5, 4, '<p class=\"ql-align-justify\">Di dekat rumah saya, diadakan acara sosial untuk masyarakat. Saya diminta untuk <strong>menemani anak-anak </strong>kecil di sana. Saya akan ...<br>', 'Mengajarkan hitungan sederhana pada mereka.', 'Menceritakan sebuah cerita yang menarik pada mereka.', 'Mengajarkan beberapa ucapan bahasa asing sederhana.', 'Mengajak mereka menghapal surat-surat pendek.', '9203a1e1-87a8-3a6c-a796-b29fa9965570');
INSERT INTO `soal_peminatan_man` VALUES (6, 5, '<p class=\"ql-align-justify\">Seandainya saya menjadi <strong>orang hebat </strong>pada masa yang akan datang, saya akan …&nbsp;<br>', 'Membuat teknologi bermanfaat bagi kehidupan.', 'Meningkatkan kualitas ekonomi masyarakat kita.', 'Memopulerkan kebudayaan Indonesia ke luar negeri.', 'Membuat orang bisa mengamalkan ajaran agama Islam.', '1a2e62fb-452b-3954-a23d-3d6eab208951');
INSERT INTO `soal_peminatan_man` VALUES (7, 6, '<p class=\"ql-align-justify\"><strong>Instagram </strong>merupakan media sosial yang sangat hebat saat ini. Saya ingin ...<br>', 'Membuat aplikasi yang mirip seperti instagram.', 'Memiliki banyak teman dari berbagai daerah di Indonesia.', 'Berusaha meningkatkan kemampuan bahasa asing.', 'Mendengarkan ceramah-ceramah dari ustaz ternama.', 'cfa6121f-383e-3f6b-963e-642a45172e6e');
INSERT INTO `soal_peminatan_man` VALUES (8, 7, '<p class=\"ql-align-justify\">Seminggu yang lalu, kami berkunjung ke sebuah desa. Lalu, kami diminta untuk menceritakan <strong>pengalaman </strong>selama di sana. Saya akan bercerita tentang …', 'Kondisi keanekaragaman hayati di sana.', 'Kegiatan keseharian penduduk di sana.', 'Beberapa kesenian tradisional di sana.', 'Kondisi masyakarat yang meramaikan pengajian.', 'c20cf69e-e071-31f4-b57a-cae441990086');
INSERT INTO `soal_peminatan_man` VALUES (9, 8, 'Saya mengagumi ...', 'Seorang teknorat, seperti B. J. Habibie karena bisa membuat pesawat.', 'Seorang negarawan, seperti Ir. Soekarno karena memproklamasikan RI.', 'Seorang diplomat, seperti Agus Salim karena pandai beberapa bahasa asing.', 'Seorang ulama, seperti Buya Hamka atas karya tafsir Al-Qurannya.', 'd5547bd4-f824-3187-a282-4fc9940a96cb');
INSERT INTO `soal_peminatan_man` VALUES (10, 9, '<p class=\"ql-align-justify\">Hal yang <strong>menyenangkan </strong>bagi saya adalah …<br>', 'Belajar sains di lab/perpusatakan.', 'Punya banyak teman dari berbagai usia.', 'Menonton film dari luar negeri.', 'Mendengar nasihat-nasihat dari orang tua.', '7b3a1c30-4f91-31ad-a1a9-4ea33a556347');
INSERT INTO `soal_peminatan_man` VALUES (11, 10, '<p class=\"ql-align-justify\">Di sekolah, saya lebih <strong>senang …</strong><br>', 'Belajar rumus-rumus tertentu.', 'Menghafal pelajaran tertentu.', 'Mencoba belajar bahasa asing tertentu.', 'Mengikuti kegiatan Rohis (Rohani Islam).', 'f096a2f5-8884-3676-aa29-c02d1c32c687');
INSERT INTO `soal_peminatan_man` VALUES (12, 11, '<p class=\"ql-align-justify\">Seandainya saya diberi pilihan, saya memilih untuk <strong>menjadi </strong>…<br>', 'Dokter.', 'Psikolog.', 'Diplomat.', 'Dosen di IAIN/UIN.', '22d8029b-3a0a-3faa-a399-b8b28b4f2552');
INSERT INTO `soal_peminatan_man` VALUES (13, 12, '<p class=\"ql-align-justify\">Teman-teman yang <strong>mengasyikkan </strong>bagi saya adalah teman yang ...', 'Patuh dengan peraturan sekolah.', 'Santai dengan peraturan sekolah.', 'Mahir dalam bahasa Inggris/Arab.', 'Hebat dalam membaca doa.', 'e590e30f-5bbb-3b5c-8320-15891746bf75');
INSERT INTO `soal_peminatan_man` VALUES (14, 13, '<p class=\"ql-align-justify\"><strong>Saya </strong>adalah orang yang …<br>', 'Patuh dengan jadwal yang direncanakan.', 'Bisa berteman dari berbagai kalangan apa pun.', 'Senang kebebasan dalam berekspresi diri.', 'Senang membaca kisah-kisah nabi.', 'a6579c53-86d8-3b08-b479-59b0e12a57b5');
INSERT INTO `soal_peminatan_man` VALUES (15, 14, '<p class=\"ql-align-justify\">Pelajaran yang <strong>menyenangkan </strong>menurut saya adalah …<br>', 'IPA – Ilmu Pengetahuan Alam.', 'IPS – Ilmu Pengetahuan Sosial.', 'Bahasa Inggris atau bahasa asing lain.', 'Pendidikan Agama.', 'a096650f-b243-3099-aec3-778a9d9b3dec');
INSERT INTO `soal_peminatan_man` VALUES (16, 15, '<p class=\"ql-align-justify\">Ada berbagai <strong>negara hebat </strong>di dunia ini.&nbsp;Saya ingin mengetahui lebih lanjut tentang …', 'Orang Jerman yang maju dalam teknologi.', 'Orang Korea yang memiliki etos kerja bagus.', 'Orang Malaysia yang hebat berbahasa Inggris.', 'Orang Saudi Arabia yang taat dalam beragama.', '6022884b-b0b7-3803-bd1a-8853bfa9a365');
INSERT INTO `soal_peminatan_sma` VALUES (1, 1, 'Sekolah <em>kami </em>mengadakan perkemahan di sebuah desa yang asri. Di waktu istirahat, kami dipersilakan untuk melakukan <strong>aktivitas bebas</strong>. Saya ...', 'Melihat pemandangan alam yang mengagumkan', 'Mendekati beberapa warga untuk berkenalan', 'Mempelajari beberapa percakapan umum penduduk', 'e6fc7de5-f3a7-3ada-9e86-ea3d3a9646c0');
INSERT INTO `soal_peminatan_sma` VALUES (3, 2, 'Di masa yang akan datang, saya bermimpi menjadi <strong>orang yang sukses</strong> dalam hal tertentu. Saya berharap dapat ...', 'Menjadi ahli pada suatu bidang tertentu.', 'Menjadi kepala/manajer suatu perusahaan/instansi.', 'Bisa keliling ke beberapa negara.', '246342b4-dfd3-30fe-bf20-b496881faeb5');
INSERT INTO `soal_peminatan_sma` VALUES (5, 3, 'Paman memberi uang sebesar <strong>Rp 200.000,00 </strong>kepada saya. Saya mempunyai ide untuk membeli buku yang bermanfaat, yaitu ...', 'Buku tentang ekosistem hayati tertentu.', 'Buku keberagaman adat Indonesia.', 'Kamus bahasa tertentu.', '430e1699-008f-3caf-b3e6-677f4a25dbce');
INSERT INTO `soal_peminatan_sma` VALUES (6, 4, 'Di dekat rumah saya, diadakan acara sosial untuk masyarakat. Saya diminta untuk <strong>menemani anak-anak kecil </strong>di sana. Saya akan ...', 'Mengajarkan hitungan sederhana pada mereka.', 'Menceritakan sebuah cerita yang menarik pada mereka.', 'Mengajarkan beberapa ucapan bahasa asing sederhana.', 'bd0cc3e4-a14a-302b-904e-e6dc03796c88');
INSERT INTO `soal_peminatan_sma` VALUES (7, 5, '<span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Seandainya saya menjadi </span><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">orang hebat </strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">pada masa yang akan datang, saya akan … </span>', 'Membuat teknologi bermanfaat bagi kehidupan.', 'Meningkatkan kualitas ekonomi masyarakat kita.', 'Memopulerkan kebudayaan Indonesia ke luar negeri.', 'a0caa867-5674-300b-8606-5e5fef8ba69b');
INSERT INTO `soal_peminatan_sma` VALUES (8, 6, '<strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">Instagram </strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">merupakan media sosial yang sangat hebat saat ini. Saya ingin ...</span>', 'Membuat aplikasi yang mirip seperti instagram.', 'Memiliki banyak teman dari berbagai daerah di Indonesia.', 'Berusaha meningkatkan kemampuan bahasa asing.', '9d8e574b-22fa-3b7d-bcae-2cb04dce64c1');
INSERT INTO `soal_peminatan_sma` VALUES (9, 7, '<span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Seminggu yang lalu, kami berkunjung ke sebuah desa. Lalu, kami diminta untuk menceritakan p</span><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">engalaman </strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">selama di sana. Saya akan bercerita tentang …</span>', 'Kondisi keanekaragaman hayati di sana.', 'Kegiatan keseharian penduduk di sana.', 'Beberapa kesenian tradisional di sana.', 'e3f1ef9b-82a1-355c-a88f-227cb785a4f8');
INSERT INTO `soal_peminatan_sma` VALUES (10, 8, '<span style=\"color: rgb(0, 0, 0); background-color: transparent;\">Saya </span><strong style=\"color: rgb(0, 0, 0); background-color: transparent;\">mengagumi </strong><span style=\"color: rgb(0, 0, 0); background-color: transparent;\">...</span>', 'Seorang teknorat, seperti B. J. Habibie karena bisa membuat pesawat.', 'Seorang negarawan, seperti Ir. Soekarno karena memproklamasikan RI.', 'Seorang diplomat, seperti Agus Salim karena pandai beberapa bahasa asing.', 'e6032c1b-7721-31f8-9990-41d511a15489');
INSERT INTO `soal_peminatan_sma` VALUES (11, 9, '<span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Hal yang </span><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">menyenangkan </strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">bagi saya adalah …</span>', 'Belajar sains di lab/perpusatakan.', 'Punya banyak teman dari berbagai usia.', 'Menonton film dari luar negeri.', 'adc222b0-d1c6-317e-b021-4ca94b4a5682');
INSERT INTO `soal_peminatan_sma` VALUES (12, 10, '<span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Di sekolah, saya lebih </span><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">senang …</strong>', 'Belajar rumus-rumus tertentu.', 'Menghafal pelajaran tertentu.', 'Mencoba belajar bahasa asing tertentu.', 'fb4e431c-5895-3774-ba40-e7405e9844c3');
INSERT INTO `soal_peminatan_sma` VALUES (13, 11, '<span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Seandainya saya diberi pilihan, saya memilih untuk </span><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">menjadi&nbsp;</strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">…</span>', 'Dokter', 'Psikolog', 'Diplomat', '8a3dcd8a-feec-3117-b072-0c4e16d27124');
INSERT INTO `soal_peminatan_sma` VALUES (14, 12, '<span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Teman-teman yang mengasyikkan bagi saya adalah teman yang ...</span>', 'Patuh dengan peraturan sekolah.', 'Santai dengan peraturan sekolah.', 'Mahir dalam bahasa Inggris/Arab', 'f359afaf-45ab-3c55-b815-8f3462894126');
INSERT INTO `soal_peminatan_sma` VALUES (15, 13, '<strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">Saya </strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">adalah orang yang …</span>', 'Patuh dengan jadwal yang direncanakan.', 'Bisa berteman dari berbagai kalangan apa pun.', 'Senang kebebasan dalam berekspresi diri.', '1f5afca5-155e-3aaa-8729-dbf0ec646815');
INSERT INTO `soal_peminatan_sma` VALUES (16, 14, '<span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Pelajaran yang </span><strong style=\"background-color: transparent; color: rgb(0, 0, 0);\">menyenangkan </strong><span style=\"background-color: transparent; color: rgb(0, 0, 0);\">menurut saya adalah …</span>', 'IPA – Ilmu Pengetahuan Alam.', 'IPS – Ilmu Pengetahuan Sosial.', 'Bahasa Inggris atau bahasa asing lain.', 'cdf4f491-a103-37ae-a796-cce65a887757');
INSERT INTO `soal_peminatan_sma` VALUES (17, 15, '<span style=\"background-color: transparent; color: rgb(0, 0, 0);\">Ada berbagai negara hebat di dunia ini.&nbsp; Saya ingin mengetahui lebih lanjut tentang …</span>', 'Orang Jerman yang maju dalam teknologi.', 'Orang Korea yang memiliki etos kerja bagus.', 'Orang Malaysia yang hebat berbahasa Inggris.', '3d0ec3f7-69b5-3ac0-b1f4-6f5e64931938');
INSERT INTO `soal_peminatan_smk` VALUES (4, 'B', '<ul><li>Mempelajari tentang aneka minuman.</li><li>Menata hidangan untuk suatu perjamuan tertentu.</li><li>Berkeliling Indonesia untuk mempelajari resep nusantara.</li><li>Membantu membuat makanan ringan untuk sebuah acara.</li><li>Mempelajari menu makanan negara lain, seperti Eropa, Tiongkok, Arab, dsb.</li></ul>', '2651639016919.png', 'Tata Boga', 'Contoh Deskripsi', '42770d82-4ce2-3cfd-84f8-a0ef208bab99');
INSERT INTO `soal_peminatan_smk` VALUES (3, 'A', '<ul><li>Menghitung biaya dan waktu untuk membuat sebuah bangunan.</li><li>Memikirkan ide desain gambar rumah, gedung, atau perkantoran.</li><li>Mempelajari teknik pemasangan batu bata untuk sebuah bangunan.</li><li>Mempelajari cara pengecoran semen untuk jalan, jembatan, atau irigasi.</li><li>Membantu survei tempat untuk membangun sebuah pondasi bangunan.</li></ul>', '1091639016850.png', 'Teknik Konstruksi Bangunan', NULL, 'defc7c5b-56ce-3722-b271-03d611bdaca2');
INSERT INTO `soal_peminatan_smk` VALUES (5, 'C', '<ul><li>Memodifikasi beberapa bagian dari sebuah kendaraan. </li><li>Mempelajari cara menyervis motor/mobil serta mengganti oli. </li><li>Bisa menjelaskan fungsi dari komponen kendaraan bermotor. </li><li>Mempelajari sistem/cara kerja dari mesin kendaraan bermotor. </li><li>Mengikuti pelatihan memperbaiki mobil/motor yang bermasalah.</li></ul>', '9651639303421.jpg', 'Teknik Mesin', NULL, '9e292dd5-da5d-3fde-b3b2-c2ee29aba49f');
INSERT INTO `soal_peminatan_smk` VALUES (6, 'D', '<ul><li>Menjahit busana modern maupun tradisional. </li><li>Membuat rancangan seragam untuk sebuah acara. </li><li>Mempelajari berbagai jenis kain untuk diolah menjadi pakaian. </li><li>Membuat aksesori yang menarik untuk suatu busana tertentu. </li><li>Membantu mengukur badan untuk pola pakaian yang dijahit.</li></ul>', '9371639303527.jpg', 'Tata Busana', NULL, '627a3700-b996-3bdf-966e-50aa5b114713');
INSERT INTO `soal_peminatan_smk` VALUES (7, 'E', '<ul><li>Bisa memperbaiki benda elektronik yang rusak ringan. </li><li>Membantu membuat sirkuit suatu aliran listrik tertentu. </li><li>Bisa menjelaskan fungsi-fungsi dalam komponen HP, TV, dan kulkas. </li><li>Mengikuti pelatihan tentang mengelas suatu benda berbahan besi. </li><li>Ikut membuat energi listrik dari sumber alternatif (surya, air, atau angin).</li></ul>', '9511639303573.jpg', 'Teknik Listrik dan Elektro', NULL, '022487a5-2b7f-3e53-a14b-7692d2d07b29');
INSERT INTO `soal_peminatan_smk` VALUES (8, 'F', '<ul><li>Mempelajari berbagai teknik pemotongan rambut. </li><li>Merias wajah (make up) seseorang untuk suatu acara. </li><li>Mengikuti pelatihan memilih bahan/produk kecantikan kulit. </li><li>Bisa memberikan rekomendasi bahan alami untuk perawatan wajah.</li><li> Senang membaca buku teknik perawatan tubuh yang baik dan sehat.</li></ul>', '8701639303624.jpg', 'Tata Rias Kecantikan', NULL, '97c5a35e-6296-32f2-ac74-39e264608280');
INSERT INTO `soal_peminatan_smk` VALUES (9, 'G', '<ul><li>Mengikuti pelatihan tentang cara merakit komponen komputer. </li><li>Berniat mempelajari bahasa pemrograman tertentu. </li><li>Mampu menginstal program sederhana di HP, laptop, atau komputer. </li><li>Menjadi bagian tim yang membuat sinyal internet alternatif bagi warga. </li><li>Mempelajari pola jaringan komputer di sebuah tempat, gedung, atau wilayah.</li></ul>', '1161639303683.jpg', 'Teknik Komputer dan Jaringan', NULL, 'b5600d3c-b32f-3861-873b-30f1106fda3f');
INSERT INTO `soal_peminatan_smk` VALUES (10, 'H', '<ul><li>Bersedia menjadi sekretaris pribadi atau notulis dalam suatu rapat. </li><li>Membantu menyimpan file-file penting dari sebuah instansi tertentu. </li><li>Mengikuti pelatihan cara membuat surat resmi yang baik dan benar. </li><li>Mempelajari teknik mengetik yang cepat dan benar dengan komputer. </li><li>Mengasah kemampuan Mic. word, excel, power point untuk administrasi</li></ul>', '9911639303720.jpg', 'Administrasi Perkantoran', NULL, '918b9af8-b3fc-34e6-aaae-c6a1274e45ca');
INSERT INTO `soal_peminatan_smk` VALUES (11, 'I', '<ul><li>Menghadiri seminar kandungan minyak dan gas di Indonesia. </li><li>Mempelajari cara penambangan emas, batubara, tembaga, nikel, dll. </li><li>Ikut serta dalam kegiatan mengukur luas suatu wilayah/tempat/daerah. </li><li>Mempelajari pengolahan aluminium, nikel, besi menjadi barang setengah jadi. </li><li>Tim yang meneliti tentang jenis dan kadar batuan di suatu wilayah tertentu.&nbsp;</li></ul>', '3461639303770.jpg', 'Teknik Pertambangan', NULL, '1474224b-1047-3aa9-86c2-ce0fda7107f5');
INSERT INTO `soal_peminatan_smk` VALUES (12, 'J', '<ul><li>Membuat anyaman dari rotan atau bambu. </li><li>Membuat suatu relief bergambar di suatu tempat. </li><li>Senang melukis sketsa wajah atau pemandangan. </li><li>Mem-furnishing suatu benda supaya terlihat menawan dan indah. </li><li>Membuat ukiran tertentu yang berasal dari kayu, batu, atau tanah liat.</li></ul>', '4821639303812.jpg', 'Teknik Kriya Seni', NULL, '3e1d399d-854e-3999-920f-7ff27a5bd2a2');
INSERT INTO `soal_peminatan_smk` VALUES (13, 'K', '<ul><li>Mengikuti pelatihan navigasi di lautan. </li><li>Mempelajari komponen cara kerja mesin kapal. </li><li>Mempelajari teknologi penangkapan hasil-hasil laut. </li><li>Membuat sketsa gambar suatu boat, kapal pesiar, atau kargo. </li><li>Mempelajari cara memperbaiki bagian mesin kapal yang rusak ringan.</li></ul>', '3821639303906.jpg', 'Teknik Perkapalan', NULL, 'a9d98775-8fd4-32d8-a166-ea66a39a329f');
INSERT INTO `soal_peminatan_smk` VALUES (14, 'L', '<ul><li>Bersedia menjadi pemandu wisata di daerah-daerah. </li><li>Bersedia magang di sebuah kapal pesiar sebagai kru kapal. </li><li>Menata jadwal suatu acara promosi pariwisata alam/budaya. </li><li>Menjadi front office (pelayan depan) di sebuah tempat kegiatan. </li><li>Menata kamar hotel (house keeping) yang sehat, bersih, dan menawan.</li></ul>', '1121639303890.jpg', 'Pariwisata dan Perhotelan', NULL, 'fefefcf0-1ea2-3588-99f5-328ea9565783');
INSERT INTO `soal_peminatan_smk` VALUES (15, 'M', '<ul><li>&nbsp;Memilih bibit unggul untuk perkebunan sawit, karet, pinang, dll. </li><li>Ikut membudidayakan cabe, kol, kentang, tomat, dan sejenisnya. </li><li>Mempelajari cara perawatan tanah (lahan pertanian) supaya subur. </li><li>Mengikuti pelatihan mengolah hasil pertanian menjadi produk siap jual. </li><li>Ingin mengetahui jenis &amp; obat hama penyerang tanaman di perkebunan.&nbsp;</li></ul>', '9981639303936.jpg', 'Teknik Pertanian (Agro)', NULL, 'd8f866c0-d67d-3d6b-9929-f462e9e0e97f');
INSERT INTO `soal_peminatan_smk` VALUES (16, 'N', '<ul><li>Bersedia berjualan makanan/minungan ringan di suatu tempat. </li><li>Mempelajari tata letak produk yang bagus di sebuah tokoh. </li><li>Mengikuti pelatihan berkomunikasi yang baik kepada pembeli/pelanggan. </li><li>Mengenali barang atau jasa yang bisa menghasilkan sebuah pendapatan. </li><li>Membaca pemanfaatan media sosial untuk promosi suatu produk.</li></ul>', '3111639304003.jpg', 'Pemasaran Tata Niaga', NULL, '299697d0-4b4e-3327-add5-195d13c83a98');
INSERT INTO `soal_peminatan_smk` VALUES (17, 'O', '<ul><li>Mempelajari cara memelihara gigi supaya sehat, kuat, dan bersih. </li><li>Membaca tentang tanaman, bahan, dan sesuatu untuk dijadikan obat. </li><li>Mempelajari cara mengenali, mencegah, dan mengobati suatu penyakit. </li><li>Menghadiri seminar tentang memilih makanan sesuai kebutuhan tubuh. </li><li>Bisa menjelaskan fungsi jantung, paru-paru, ginjal, atau usus manusia.</li></ul>', '5131639304041.jpg', 'Kesehatan', NULL, 'a4bb78f5-21c1-30a9-a96b-3241b24b8b48');
INSERT INTO `soal_peminatan_smk` VALUES (18, 'P', '<ul><li>Membuat perencanaan keuangan masa depan sebuah keluarga. </li><li>Mengikuti pelatihan cara membuat laporan keuangan perusahaan. </li><li>Ingin mengetahui lebih banyak tentang perbankan, pajak, bisnis, dll. </li><li>Mempelajari cara menilai harga sebuah barang, produk, ataupun jasa. </li><li>Ikut membuat anggaran biaya untuk kegiatan kemasyarakatan/sosial.&nbsp;</li></ul>', '2651639304125.jpg', 'Akuntansi', NULL, '58a5c36d-db0e-3817-9120-f629b607e140');
INSERT INTO `soal_peminatan_smk` VALUES (19, 'Q', '<ul><li>Membuat sebuah poster dengan software tertentu. </li><li>Bagian tim membuat film pendek, film dokumenter, atau iklan. </li><li>Mempelajari cara mengedit tata suara, efek, gambar, dan video. </li><li>Ikut pelatihan cara membuat sebuah animasi di laptop/komputer.</li><li> Ingin mengetahui lebih lanjut tentang kamera, video, alat-alat multimedia.</li></ul>', '1401639304145.jpg', 'Multimedia', NULL, 'fe55c013-0afd-38b7-a026-4b15b0346ddd');
