INSERT INTO `soal_sikap_pelajaran` VALUES (10, 10, 'Geografi', 'GEO', 'Berat', 'Ringan', 'Tidak Bermanfaat', 'Bermanfaat', 'Dibenci', 'Dicintai', 'ILMU_SOSIAL', 'sikap_geo', 'b914b2c2-d607-319b-a4dd-077a28482a71');
INSERT INTO `soal_tipologi_jung` VALUES (2, 'K1', 1, '<em>Saya menghadiri sebuah hajatan bersama teman. Tuan rumah mempersilahkan kami untuk masuk menyantap hidangan. Maka saya,</em>', 'mengajak teman untuk mengambil hidangan', 'mengambil hidangan jika ada teman yang memulai', 'a4f5c40b-0ddd-30cb-aa4f-3c4c52f7cd51');
INSERT INTO `soal_tipologi_jung` VALUES (3, 'K2', 2, '<em>Saya diminta untuk menjadi panitia sebuah acara, saya memilih untuk</em>', 'bergabung dibidang yang saya sering terlibat di dalamnya', 'mencoba bidang yang belum pernah saya terlibat di dalamnya', '85c67c5e-c27b-3e4f-a0c8-eb8cfc564b8d');
INSERT INTO `soal_tipologi_jung` VALUES (4, 'K3', 3, '<em>Saat saya akan mengkritik orang lain, hal pertama yang saya pertimbangkan adalah</em>', 'benar atau tidaknya hal yang saya kritik', 'bagaimana perasaan orang yang saya kritik kelak', '5e53a511-3d40-3ed8-85ab-ff57b864d079');
INSERT INTO `soal_tipologi_jung` VALUES (5, 'K4', 4, '<em>Ada beberapa PR yang diberikan oleh guru, saya</em>', 'akan segera mengerjakannya', 'mengerjakannya nanti saja saat ada waktu yang tepat', '51e780a2-f021-3cf9-9cef-5c5c07f1b65e');
INSERT INTO `soal_tipologi_jung` VALUES (6, 'K1', 5, '<em>Ada tetangga baru di sebelah rumah, saya akan</em>', 'mendatangi mereka untuk berkenalan', 'menunggu mereka datang untuk berkenalan', '6769040f-d273-349c-bbe9-603917873e43');
INSERT INTO `soal_tipologi_jung` VALUES (7, 'K2', 6, '<em>Saya pergi mengunjungi keluarga dengan mengendarai kendaraan. Tidak ada hal yang mendesak sehingga saya bisa santai dalam perjalanan. Saya memilih untuk</em>', 'melewati jalan yang biasa saya lalui', 'mencoba jalan alternatif', 'a1477ee0-5d59-39e7-8162-d739b7a1d687');
INSERT INTO `soal_tipologi_jung` VALUES (8, 'K3', 7, '<em>Jika ada teman yang berselisih paham, saya akan</em>', 'berusaha untuk memperjelas persoalannya', 'berusaha untuk mendamaikan mereka', '2e24479d-a548-32d5-8f68-cf0ad17dbf84');
INSERT INTO `soal_tipologi_jung` VALUES (9, 'K4', 8, '<em>Saya memiliki banyak tugas yang dikerjakan sekaligus. </em><em>Hal yang saya rasakan adalah</em>', 'mudah marah', 'tetap bisa tenang', '96943d00-7cea-30fc-a00d-db921fa737f8');
INSERT INTO `soal_tipologi_jung` VALUES (10, 'K1', 9, '<em>Saya berada di rumah sendirian, tidak ada orang di sekitar saya. Saya</em>', 'mengajak teman untuk datang ke rumah', 'merasa tenang/aman sendirian', '49827c22-1f9e-3747-9581-5c1f6ea04fff');
INSERT INTO `soal_tipologi_jung` VALUES (11, 'K2', 10, '<em>Saat kami sedang diskusi di kelas, ada berbagai pendapat teman yang bagus. Saya akan&nbsp;</em>', 'setuju dengan pendapat teman-teman yang bagus tersebut', 'memberikan pendapat yang lain, walaupun kontroversial', '166452a9-7076-3b1a-9885-b00dbf3d78d3');
INSERT INTO `soal_tipologi_jung` VALUES (12, 'K3', 11, '<em>Seorang teman mendapatkan nilai yang rendah di akhir semester, hal yang terpikir di benak saya adalah</em>', 'dia mungkin tidak belajar dengan giat', 'dia perlu diberi dorongan', 'd326880a-4faf-330a-834b-91ccecec5cbd');
INSERT INTO `soal_tipologi_jung` VALUES (13, 'K4', 12, '<em>Guru memberikan PR kepada kami yang dikumpulkan minggu depan. Saya mengerjakan PR tersebut</em>', 'segera mengerjakannya setelah pulang sekolah', 'menjelang waktu mengumpul nanti', '8e1ddbe4-fa65-3662-955f-b845f52936a7');
INSERT INTO `soal_tipologi_jung` VALUES (14, 'K1', 13, '<em>Dalam kehidupan sehari-hari, saya</em>', 'senang terlibat aktif di sebuah organisasi', 'senang melakukan hobi saya sendirian', '91936de2-421c-37d4-8386-70d0d7c34a69');
INSERT INTO `soal_tipologi_jung` VALUES (15, 'K2', 14, '<em>Jika saya menghadapi sebuah permasalahan, saya memecahkannya dengan</em>', 'cara saya yang sebelumnya sudah terbukti berhasil', 'cara baru yang saya dapat, walaupun belum tentu berhasil', '0dcce31d-fe27-3396-ae00-22a26a99ec7d');
INSERT INTO `soal_tipologi_jung` VALUES (16, 'K3', 15, '<em>Kami sedang makan di sebuah restoran. Pada dasarnya, masakannya enak. Namun, ada pelayanan yang kurang memuaskan. Maka saya akan&nbsp;</em>', 'menyampaikan keluhan pada pihak pengelola restoran tersebut', 'menceritakan masakannya yanag enak pada teman', '3eaa912e-aad6-3a55-9a3d-378c5cfccd83');
INSERT INTO `soal_tipologi_jung` VALUES (17, 'K4', 16, '<em>Saya diundang untuk menghadiri acara di rumah teman pada hari minggu. Maka&nbsp;</em>', 'saya mengosongkan jadwal hari tersebut agar bisa menghadiri acara tersebut', 'saya hadir atau tidak tergantung situasi', 'b6d2119d-2a36-3b06-a128-74367c8e0a3f');
INSERT INTO `soal_tipologi_jung` VALUES (18, 'K1', 17, '<em>Pada pelajaran Bahasa Indonesia, kami diminta membuat sebuah cerpen. Saya belum mendapatkan ide. Saya akan&nbsp;</em>', 'bersdiskusi dengan teman tentang idenya', 'pergi sendirian ke sebuah tempat untuk mencari ide', '1b6970d8-7d1b-3f09-93ed-cbff91ca3421');
INSERT INTO `soal_tipologi_jung` VALUES (19, 'K2', 18, '<em>Perguruan tinggi impian saya adalah yang</em>', 'menyediakan jaminan pekerjaan', 'memiliki reputasi yang baik/ternama', '682f1678-efbd-3b4c-bf3b-41132d356cc5');
INSERT INTO `soal_tipologi_jung` VALUES (20, 'K3', 19, '<em>Menurut saya, saya lebih peka terhadap</em>', 'kekurangan orang lain dan diri saya', 'kebaikan orang lain dan diri saya', '091dbfbb-a711-3ff7-9452-c4edc54b847f');
INSERT INTO `soal_tipologi_jung` VALUES (21, 'K4', 20, '<em>Saya dan teman-teman akan membahas sebuah materi pelajaran. Saat pembahasan, saya</em>', 'telah mempelajari materi tersebut sebelumnya', 'ikut saja pembahasan materi nanti', 'e417ea2e-13a2-306b-a038-f2dca8f1f0e9');
INSERT INTO `soal_tipologi_jung` VALUES (22, 'K1', 21, '<em>Kelas mengadakan diskusi sebuah mata pelajaran, saya</em>', 'bersedia menjadi pengarah diskusi/moderator', 'lebih nyaman menjadi peserta', '962c12a5-2dae-30fa-9810-979fed1fe6bc');
INSERT INTO `soal_tipologi_jung` VALUES (23, 'K2', 22, '<em>Saat saya telah berhasil menguasai suatu keahlian tertentu, saya akan</em>', 'mendalami keahlian tersebut', 'mencoba keahlian yang lain lagi', '0f83036e-da02-341a-b95c-05d4e15d2200');
INSERT INTO `soal_tipologi_jung` VALUES (24, 'K3', 23, '<em>Kami memiliki seorang guru yang menyenangkan. Namun, pelajaran yang ia ajarkan sering tidak sesuai topik. Bagi saya&nbsp;</em>', 'guru sebaiknya mengajarkan materi sesuai topik', 'tetap senang dengan guru tersebut', 'd0c67478-6890-3b08-8dbe-6bafc586e1e7');
INSERT INTO `soal_tipologi_jung` VALUES (25, 'K4', 24, '<em>Saya diundang oleh teman saya menghadiri sebuah rapat. Maka saya&nbsp;</em>', 'mencari tahu apa saja agenda, siapa yang datang, dan berapa lama waktunya', 'akan mengikuti rapat sesuai dengan situasi nanti', '7b8e0683-4e16-38ca-92ca-905297680498');
INSERT INTO `soal_tipologi_jung` VALUES (26, 'K1', 25, '<em>Saat baru pulang dari sebuah liburan yang mengasyikan, saya&nbsp;</em>', 'bercerita tentang liburan, walaupun tidak ditanya', 'bercerita saat diminta', '7aebda0e-9c3c-3490-9659-659498eebf6a');
INSERT INTO `soal_tipologi_jung` VALUES (27, 'K2', 26, '<em>Dalam kehidupan sehari-hari, saya lebih yakin kepada&nbsp;</em>', 'hal yang jelas terjadi', 'firasat saya', 'e77840f0-9ed3-3d76-8389-132736bedcbf');
INSERT INTO `soal_tipologi_jung` VALUES (28, 'K3', 27, '<em>Kami diminta guru untuk membuat sebuah karya. Saya sudah memikirkan ide yang bagus. Maka, saya akan berusaha&nbsp;</em>', 'memperjuangkan ide supaya diterima', 'menggabungkan ide saya dengan orang yang lain', '7263f39e-e4a4-3fd7-a2b1-2376929fb08c');
INSERT INTO `soal_tipologi_jung` VALUES (29, 'K4', 28, '<em>Kami akan makan bersama di sebuah tempat yang disepakati. Dalam perjalanan, ada seorang teman mengusulkan tempat lain. Saya&nbsp;</em>', 'menginginkan tempat yang telah disepakati', 'boleh-boleh saja', 'e43ec82c-07a7-3ebe-924a-2f6229262c95');
INSERT INTO `soal_tipologi_jung` VALUES (30, 'K1', 29, 'Guru meminta kami untuk berbagi pengalaman yang mengesankan, saya lebih nyaman&nbsp;', 'bercerita di hadapan teman-teman', 'menulisnya dalam sebuah karangan', '202fab51-9305-359d-a45c-7671e4394cb5');
INSERT INTO `soal_tipologi_jung` VALUES (31, 'K2', 30, '<em>Dalam melakukan sesuatu, saya lebih senang menggunakan</em>', 'fakta yang jelas terjadi dilapangan', 'teori atau petunjuk yang saya baca dari buku', 'd59cab62-0fa0-3595-a743-a27cfcbcc785');
INSERT INTO `soal_tipologi_jung` VALUES (32, 'K3', 31, '<em>Kami membuat sebuah kelompok. Seiring berjalannya waktu, banyak teman yang sudah tidak sesuai dengan komitmen awal. Maka saya</em>', 'keluar dari kelompok jika teman-teman tidak kembali ke komitmen awal', 'tetap berada didalam kelompok demi menjaga pertemanan', 'a417d01e-be13-30c7-a3b7-cb1917d1622c');
INSERT INTO `soal_tipologi_jung` VALUES (33, 'K4', 32, '<em>Saat akan diskusi kelompok, saya</em>', 'meminta untuk menentukan sampai jam berapa berdiskusi', 'bersedia untuk berdiskusi sampai jam berapapun, selama tidak ada kegiatan lain', '057626ad-2aea-3d97-93b4-50ef4a2db98f');
INSERT INTO `soal_tipologi_jung` VALUES (34, 'K1', 33, '<em>Seorang teman yang sedang liburan menghubungi saya. Dia bilang bahwa dia membawa oleh-oleh buat saya. Saya pun&nbsp;</em>', 'menjawab telepon dengan ekspresif', 'merasa senang di dalam hati', '30259f66-9479-3765-932f-4ac1d9ff762e');
INSERT INTO `soal_tipologi_jung` VALUES (35, 'K2', 34, '<em>Saya senang memikirkan tentang bagaimana</em>', 'mengubah sesuatu dimulai dari hal yang kecil', 'cara menciptakan sesuatu yang luar biasa', '63fe9278-38fd-3115-b336-3fdf1dbee6e5');
INSERT INTO `soal_tipologi_jung` VALUES (36, 'K3', 35, '<em>Saya menargetkan nilai 90. Namun, saya mendapatkan nilai 80. Hal yang terpikir di benak saya&nbsp;</em>', 'merasa kurang giat belajar', 'tetap bersyukur', 'aa07dfb0-f494-3ddc-a8a4-28d6bea91736');
INSERT INTO `soal_tipologi_jung` VALUES (37, 'K4', 36, '<em>Saat teman meminjam sesuatu pada saya, ia sebaiknya mengembalikannya</em>', 'segera setelah selesai digunakan', 'kapanpun boleh, harus ada ketika saya butuhkan', '1b42992a-6f52-3031-98b3-3d7848cc0787');
INSERT INTO `soal_tipologi_jung` VALUES (38, 'K1', 37, 'Saat melihat teman dari jauh, saya akan', 'memanggil dan mendekatinya', 'mendekati dan menyapanya', 'da134521-902a-37c7-8b2a-76c834092327');
INSERT INTO `soal_tipologi_jung` VALUES (39, 'K2', 38, '<em>Ada berbagai kegiatan di lingkungan kampung saya, saya memilih untuk</em>', 'terlibat di kegiatan yang jelas bermanfaat bagi saya saat ini', 'mengurus sebuah organisasi, walaupun manfaatnya belum terasa saat ini', '798f96b4-e292-3f6f-946b-b671c6f36d87');
INSERT INTO `soal_tipologi_jung` VALUES (40, 'K3', 39, '<em>Saya menonton sebuah film. Ada sebuah adegan yang mengharukan. Saya</em>', 'sedih dan tidak sampai menangis', 'sedih dan bahkan sampai menangis', 'dd528e11-34bd-3e49-a1af-27f6dfadaa19');
INSERT INTO `soal_tipologi_jung` VALUES (41, 'K4', 40, '<em>Dalam melakukan aktivitas sehari-hari, saya melakukannya berdasarkan</em>', 'jadwal yang telah disusun', 'kegiatan yang ingin dilakukan saat ini', '83eda0d7-b0d9-305d-9d22-351f5c08e731');
INSERT INTO `soal_tipologi_jung` VALUES (42, 'K1', 41, '<em>Saat melihat teman dari jauh, saya akan</em>', 'memanggil dan mendekatinya', 'mendekati dan menyapanya', 'ccbb2fa5-99cd-366b-a58a-d3a93a9b5edf');
INSERT INTO `soal_tipologi_jung` VALUES (43, 'K2', 42, '<em>Saya lebih menyarankan teman-teman untuk</em>', 'fokus belajar terlebih dahulu', 'memiliki cita-cita yang tinggi', '4c42319d-a522-3b47-9340-8c6f5dbf62aa');
INSERT INTO `soal_tipologi_jung` VALUES (44, 'K3', 43, '<em>Jika teman-teman mengajak saya menonton, saya akan memilih film</em>', 'aksi atau perang', 'drama atau percintaan', 'cfcbea0a-0758-342d-997e-813bc3640b1c');
INSERT INTO `soal_tipologi_jung` VALUES (45, 'K4', 44, '<em>Teman-teman memberi tahu bahwa mereka telat datang ke tempat yang kami sepakati. Saya</em>', 'tetap datang sesuai janji', 'menyesuaikan dengan jadwal mereka', '74c73302-a7b9-37d9-af97-ddb99039de1c');
INSERT INTO `soal_tipologi_jung` VALUES (46, 'K1', 45, '<em>Saya bisa bercerita dengan cepat sambil menggerakkan tangan saat menceritakan sesuatu</em>', 'menggambarkan diri saya', 'tidak menggambarkan diri saya', 'd4524a75-3499-3f42-a250-1bd99254568d');
INSERT INTO `soal_tipologi_jung` VALUES (47, 'K2', 46, '<em>Kelompok kami akan membuat sebuah kegiatan. Saya mengusulkan kegiatan yang sesuai dengan&nbsp;</em>', 'kemampuan kami', 'harapan kami', '8896697e-c3d6-398c-8968-5c74ad0a61e6');
INSERT INTO `soal_tipologi_jung` VALUES (48, 'K3', 47, '<em>Jika saya diberi pilihan, saya akan memilih untuk menjadi&nbsp;</em>', 'tentara atau polisi', 'guru TK', '5d54bf69-eeea-3e3d-a84b-d1dc61861bc1');
INSERT INTO `soal_tipologi_jung` VALUES (49, 'K4', 48, '<em>Setiap pagi saat hendak ke sekolah, saya&nbsp;</em>', 'berangkat pagi-pagi', 'berangkat menjelang waktunya', 'd3bc52b0-c969-37fb-a6d1-c03a612167a9');
INSERT INTO `soal_tipologi_jung` VALUES (50, 'K1', 49, '<em>Dalam kehidupan sehari-hari, saya lebih senang</em>', 'melakukan beberapa kegiatan sekaligus', 'fokus pada kegiatan tertentu', '8f4578b5-d650-351a-a3a7-919776d32897');
INSERT INTO `soal_tipologi_jung` VALUES (51, 'K2', 50, '<em>Saat diminta untuk menceritakan sesuatu, saya</em>', 'bisa bercerita secara berurutan', 'kesulitan bercerita secara berurutan', 'ff91fbfe-52ff-325c-8997-b47d53a8a5f4');
INSERT INTO `soal_tipologi_jung` VALUES (52, 'K3', 51, '<em>Teman saya berniat menjadi ketua OSIS. Maka saya</em>', 'ingin mengetahui program kerjanya', 'merasa senang dengan keinginan teman', '2efaec79-086e-3eaf-a30c-2d71637af0b0');
INSERT INTO `soal_tipologi_jung` VALUES (53, 'K4', 52, '<em>Saya bersama teman-teman membuat kelompok belajar, saya</em>', 'mengusulkan untuk membuat peraturan kelompok', 'lebih nyaman kelompok yang tanpa peraturan tertentu', '3dbe69e9-5cee-3767-a956-537f71ddbc36');
INSERT INTO `soal_tipologi_jung` VALUES (54, 'K1', 53, '<em>Dalam berteman, saya lebih suka</em>', 'memiliki teman dari latar belakang yang beragam, walaupun tidak akrab', 'menyenangi persahabatan karib dengan beberapa orang', 'd29731a6-01c2-3d21-b30c-16933d121346');
INSERT INTO `soal_tipologi_jung` VALUES (55, 'K2', 54, '<em>Saat mengerjakan soal ujian, saya mengerjakannya</em>', 'dari nomor pertama ke nomor berikutnya dan melewati nomor yang belum bisa', 'secara acak sesuai dengan inspirasi/keinginan saya', '479a6e27-019e-3a56-92d6-b6271caed7eb');
INSERT INTO `soal_tipologi_jung` VALUES (56, 'K3', 55, '<em>Ada sebuah kebijakan sekolah yang tidak sesuai dengan harapan saya. Saya akan</em>', 'berdiskusi dengan teman tentang kebijakan tersebut', 'berusaha menyesuaikan diri dengan kebijakan tersebut', '23622248-fc2e-3bfd-a7be-6f763a201b31');
INSERT INTO `soal_tipologi_jung` VALUES (57, 'K4', 56, '<em>Dalam kehidupan sehari-hari, saya lebih senang dengan teman yang</em>', 'patuh terhadap peraturan sekolah', 'tidak kaku terhadap peraturan sekolah', 'd4ef20bd-c829-3252-8ee7-30938c64bb42');
INSERT INTO `soal_tipologi_jung` VALUES (58, 'K1', 57, '<em>Ada berbagai acara yang bisa dihadiri di lingkungan kampung saya. Saya akan menghadiri</em>', 'semua acara yang memungkinkan saya untuk datang', 'acara yang menjadi minat saya', '9f7234ed-5295-3029-95a4-7cb1331ce8c5');
INSERT INTO `soal_tipologi_jung` VALUES (59, 'K2', 58, '<em>Ketika saya melihat sebuah benda, saya melihatnya</em>', 'secara keseluruhan', 'bagian tertentu yang saya sukai', 'f85333fb-695e-38b6-b985-9ba6981f77a4');
INSERT INTO `soal_tipologi_jung` VALUES (60, 'K3', 59, '<em>Kelompok kami diminta untuk mempresentasikan hasil diskusi. Teman-teman meminta saya untuk menjadi juru bicara kelompok. Hal yang saya lakukan</em>', 'saya tanyakan, kenapa kalian memilih saya?', 'saya mau saja, jika saya sudah siap', '4719602a-c34c-30f3-a430-5ba061f10598');
INSERT INTO `soal_tipologi_jung` VALUES (61, 'K4', 60, '<em>Salah satu tugas sebagai seorang siswa adalah belajar. Saya</em>', 'memiliki jadwal belajar khusus', 'belajar saat saya bersemangat', '933ea755-3ec4-3f32-ac4f-a2704eb5b75e');
INSERT INTO `soal_tmi` VALUES (3, 1, '<ul><li>Mempelajari cara mengenali dan mengobati suatu penyakit.</li><li>Mengikuti pelatihan pertolongan pertama pada kecelakaan ringan.</li><li>Ingin mempelajari cara penggunaan stetoskop, tensimeter, dan termometer.</li></ul>', 'ILMU_ALAM', 'MEDIS', 'Menyenangi kegiatan Kedokteran, seperti: pengenalan - pencegahan – pengobatan suatu penyakit,\r\nmemberikan pertolongan pertama pada kecelakaan ringan, penggunaan alat kedokteran, seperti: steteskop,\r\ntensimeter, termometer', '258fb609-03f7-3a22-92da-1c88e87270ac');
INSERT INTO `soal_tmi` VALUES (4, 2, '<ul><li>Berdiskusi tentang pemikiran orang-orang hebat.</li><li>Memaknai berbagai peristiwa yang terjadi pada diri sendiri.</li><li>Menghadiri seminar tentang hakikat kehidupan, Tuhan, dan manusia.</li></ul>', 'ILMU_SOSIAL', 'FILSAFAT', 'Menyenangi tentang Esensi dari Manusia, Kehidupan, Tuhan maupun Alam Semesta yang\r\ntercermin pada kegiatan berdiskusi, mempelajari, merenungkan, menulis, mempraktikannya, membaca buku-\r\nbuku pemikiran orang hebat.', '77565ec2-e38b-3649-bae2-388c6c7bbd52');
INSERT INTO `soal_tmi` VALUES (5, 3, '<ul><li>Memahami simbol-simbol peta.</li><li>Mempelajari gunung, lembah, laut, samudera, dan sungai.</li><li>Menghadiri seminar teori pembentukan daratan dan lautan Indonesia.</li></ul>', 'ILMU_ALAM', 'GEOGRAFI', 'Menyenangi Dasar Ilmu Bumi (Geografi), seperti: peta, daratan, lautan, sungai, batuan,\r\nlembah yang meliputi', 'fe8ef20f-fc59-3feb-9452-cbe4d2894478');
INSERT INTO `soal_tmi` VALUES (6, 4, '<ul><li>Senang mengarang puisi. </li><li>Ingin membuat sebuah novel. </li><li>Mengikuti perlombaan membuat Cerpen</li></ul>', 'ILMU_SOSIAL', 'SENI SASTRA', 'Menyenangi sesuatu yang berhubungan dengan Seni Sastra terlihat dalam kegiatan\r\nmempelajari, berdiskusi, membuat dan menampilkan karya sastra, seperti: novel, puisi, prosa, gurindam,\r\ncerpen, pantun', '7923371b-4d6e-3a80-9b84-52cb1ddd3826');
INSERT INTO `soal_tmi` VALUES (7, 5, '<ul><li>Tim peneliti aplikasi teori Gravitasi. </li><li>Mempelajari berbagai hal tentang Hukum Ohm. </li><li>Menghadiri seminar temuan terbaru teori relativitas energi.</li></ul>', 'ILMU_ALAM', 'FISIKA DASAR', 'Menyenangi Dasar Ilmu Fisika, seperti: teori relativitas energi, gaya dan gerak, kekekalan\r\nenergi, hukum Ohm dan Kirchoff yang termanifestasi dalam mempelajari, berdiskusi, menghadiri seminar\r\nmaupun bereksperimen', '9479efe9-fed1-3bf2-9ab1-4f80c61eaa74');
INSERT INTO `soal_tmi` VALUES (8, 6, '<ul><li>Menghadiri seminar munculnya negara adidaya baru. </li><li>Ingin membuat Indonesia menjadi negara yang disegani di dunia. </li><li>Mengamati perkembangan politik, ekonomi, dan militer internasional.</li></ul>', 'ILMU_SOSIAL', 'HUBUNGAN INTERNASIONAL', 'Menyenangi Isu-Isu Hubungan antar Negara baik itu segi politik,\r\nekonomi, sosial, budaya, hukum, maupun militer yang meliputi mempelajari, mengamati, berdiskusi maupun\r\nikut kegiatan praktisnya', '763c5501-1450-3707-a952-24b92481a4eb');
INSERT INTO `soal_tmi` VALUES (9, 7, '<ul><li>Senang merawat tanaman. </li><li>Tim pengembangbiakan tumbuhan langka. </li><li>Bisa menjelaskan nama bagian dan fungsi pohon tertentu</li></ul>', 'ILMU_ALAM', 'BOTANI', 'Menyenangi sesuatu berhubungan dengan Tumbuh-Tumbuhan tercermin pada kegiatan\r\nmerawat, mempelajari, berdiskusi, melakukan eksperimen tentang tumbuhan serta dapat mengenali berbagai\r\njenis dan fungsi organ tumbuhan.', '7fff1d5c-f039-3137-9064-3532041d531c');
INSERT INTO `soal_tmi` VALUES (10, 8, '<ul><li>Ingin membuat rumah singgah bagi orang terlantar. </li><li>Bersedia menjadi relawan ke sebuah daerah bencana. </li><li>Menghadiri seminar tentang peningkatan kesejahteraan rakyat.</li></ul>', 'ILMU_SOSIAL', 'KESEJAHTERAAN SOSIAL', 'Menyenangi kegiatan Peningkatan Kesejahteraan Masyarakat tercermin\r\ndari bersedia menjadi relawan, membuat panti, berdiskusi serta berpikir tentang bagaimana meningkatkan\r\ntaraf hidup masyarakat bawah.', '7411a69c-061a-3d3d-8269-02d971f3ff8b');
INSERT INTO `soal_tmi` VALUES (11, 9, '<ul><li>Tim pengembang model baru persamaan kuadrat. </li><li>Mempelajari berbagai hal tentang rumus bidang ruang. </li><li>Menghadiri seminar tentang aplikasi teorema phytagoras bagi kehidupan</li></ul>', 'ILMU_ALAM', 'MATEMATIKA', 'Menyenangi Dasar Ilmu Matematika, seperti: teorama phytagoras, persamaan kuadrat,\r\npersamaan garis lurus maupun aplikasi Matematika dalam kehidupan yang tercermin dalam mempelajari,\r\nmengerjakan soal, menjelaskan materi.', '64462c68-5975-3c15-acf1-e42a268b3753');
INSERT INTO `soal_tmi` VALUES (12, 10, '<ul><li>Ingin memiliki perusahaan pribadi. </li><li>Menghadiri seminar tentang mengelola sebuah usaha. </li><li>Berdiskusi tentang hal-hal yang layak dijadikan peluang bisnis.&nbsp;</li></ul>', 'ILMU_SOSIAL', 'WIRAUSAHA', 'Menyenangi sesuatu berhubungan dengan Bisnis, tercermin pada kegiatan ingin memiliki\r\nbisnis pribadi, mencari peluang di lingkungan sekitar untuk dimanfaatkan serta membuat nilai jual (tambah)\r\nsuatu produk barang atau jasa.', 'e30de1af-3cd2-3574-b96d-abfae31e8b7d');
INSERT INTO `soal_tmi` VALUES (13, 11, '<ul><li>Menghadiri seminar tentang sistem kekebalan tubuh manusia. </li><li>Mempelajari sistem saraf, reproduksi, dan pernapasan manusia. </li><li>Bisa menjelaskan fungsi jantung, paru-paru, ginjal, dan usus manusia.&nbsp;</li></ul>', 'ILMU_ALAM', 'ANATOMI MANUSIA', 'Menyenangi sesuatu berhubungan dengan Tubuh Manusia, seperti: kekebalan\r\ntubuh, peredaran darah, sistem sarat maupun organ tubuh lainnya dalam kegiatan membaca, berdiskusi,\r\nbereksperimen maupun penelitian.', '705cbcb9-aeb2-3ed8-98cb-1ce9dc3ceb97');
INSERT INTO `soal_tmi` VALUES (14, 12, '<ul><li>Membaca tentang keyakinan yang diyakini. </li><li>Bersedia menyebarkan kepercayaan yang dianut. </li><li>Berdiskusi membuat manusia patuh terhadap perintah Tuhan.</li></ul>', 'ILMU_SOSIAL', 'TEOLOGI', 'Menyenangi sesuatu yang berhubungan dengan ajaran Keagamaan, Ketuhanan, Kepercayaan\r\nyang meliputi berdiskusi, mempelajari, mempraktikannya, membaca maupun menyebarkan kepercayaan\r\nyang dianut', '0c54e36d-dea0-35e8-80be-1719861005de');
INSERT INTO `soal_tmi` VALUES (15, 13, '<ul><li>Tim peneliti jenis batuan di suatu lokasi. </li><li>Mempelajari kandungan yang ada di dalam tanah. </li><li>Menghadiri seminar temuan terbaru lapisan penyusun bumi.&nbsp;</li></ul>', 'ILMU_ALAM', 'GEOLOGI', 'Menyenangi sesuatu berhubungan dengan Lapisan, Batuan Penyusun Bumi dan Kandungan\r\ndidalamnya yang kegiatan meliputi mempelajari, berdiskusi, mengikuti kegiatan lapangan (survey)\r\nmaupun melakukan penelitian.', '5f05c876-f658-3d6f-935a-84d623e7d4df');
INSERT INTO `soal_tmi` VALUES (16, 14, '<ul><li>Senang bernyanyi. </li><li>Mendalami suatu alat musik tertentu. </li><li>Bersedia mengaransemen ulang suatu lagu</li></ul>', 'ILMU_SOSIAL', 'SENI MUSIK', 'Menyenangi sesuatu yang berhubungan dengan Seni Musik, seperti: bernyanyi,\r\nmendengarkan lagu, membuat lagu, bermain alat musik, mearansemen ulang lagu, bermain alat musik\r\nmaupun tampil di berbagai festival', 'c915ab63-f324-378e-86c6-4378a5e60c61');
INSERT INTO `soal_tmi` VALUES (17, 15, '<ul><li>Menghadiri seminar tentang temuan terbaru atom</li><li>Tim pendata kualitas energi nuklir di suatu tempat. </li><li>Menghadiri diskusi memanfaatkan nuklir untuk perdamaian.&nbsp;</li></ul>', 'ILMU_ALAM', 'NUKLIR', 'Menyenangi sesuatu yang berhubungan dengan Teknologi Nuklir, seperti: atom, pemanfaatan\r\nenergi nuklir maupun penelitian di bidang nuklir yang kegiatannya mempelajari, berdiskusi maupun ikut\r\nkegiatan penelitian.', '61b0978a-296f-361c-9cd1-a4c06a8accb2');
INSERT INTO `soal_tmi` VALUES (18, 16, '<ul><li>Menghadiri seminar pelaksanaan otonomi daerah. </li><li>Mengamati kebijakan terkini yang dibuat negara. </li><li>Tim yang mensosialisasikan pemerintahan bersih (bebas KKN)</li></ul>', 'ILMU_SOSIAL', 'PEMERINTAHAN', 'Menyenangi sesuatu berhubungan dengan Sistem Pemerintahan, seperti: otonomi\r\ndaerah, pemerintahan bersih, kebijakan pemerintahan, pengelolaan keuangan, asset daerah, pemberdayaan\r\nmasyarakat', '2142e6f7-a0d5-3e12-b9ef-ed5b122638be');
INSERT INTO `soal_tmi` VALUES (19, 17, '<ul><li>Tim pembuat pupuk bagi kesuburan tanah. </li><li>Mengikuti pelatihan meningkatkan kualitas hasil buah-buahan. </li><li>Mempelajari pengembangbiakan kol, cabe, kentang, dan jagung</li></ul>', 'ILMU_ALAM', 'PERTANIAN', 'Menyenangi sesuatu berhubungan dengan Pertanian, seperti: kesuburan tanah, antibiotik,\r\npengembangbiakan, pengentasan penyakit dan hama terhadap hasil pertanian (cabe, kol, kentang, apel,\r\njeruk, mangga).', '1300d2c3-4c4a-344a-b8b2-05c0616c1154');
INSERT INTO `soal_tmi` VALUES (20, 18, '<ul><li>Bisa menjelaskan pola hidup suatu kelompok. </li><li>Tim peneliti keadaan di sebuah desa terpencil. </li><li>Berdiskusi tentang perkembangan masyarakat saat ini</li></ul>', 'ILMU_SOSIAL', 'SOSIOLOGI', 'Menyenangi sesuatu berhubungan dengan Dinamika Sosial Suatu Masyarakat baik itu\r\nmempelajari, berdiskusi, kegiatan praktik di lapangan, maupun ikut kegiatan penelitian tentang keadaan\r\nsuatu masyarakat', 'a6bc76f7-650b-3983-b1a4-54f77157c746');
INSERT INTO `soal_tmi` VALUES (21, 19, '<ul><li>Tim pengolah data hasil sensus suatu penduduk. </li><li>Menghadiri seminar tentang rumus baru persentase. </li><li>Bisa menjelaskan tentang mean, modus, frekuensi, dan korelasi.</li></ul>', 'ILMU_ALAM', 'STATISTIK', 'Menyenangi sesuatu berhubungan dengan Ilmu Statistik, seperti: mean, median, modus,\r\nfrekuensi, korelasi yang kegiatannya mempelajari, berdiskusi, mencari rumus baru, menghadiri seminar,\r\nmendata jumlah penduduk.', 'ec54d0e4-24cc-36d6-bfb7-0337c92c5bd6');
INSERT INTO `soal_tmi` VALUES (22, 20, '<ul><li>Mengamati perkembangan kurs (nilai tukar mata uang). </li><li>Menghadiri seminar kebijakan ekspor-impor Indonesia. </li><li>Mempelajari dampak pendapatan perkapita bagi suatu negara.</li></ul>', 'ILMU_SOSIAL', 'ILMU EKONOMI', 'Menyenangi Esensi Ilmu Ekonomi, seperti: Export-Import, Kebijakan Ekonomi,\r\nPendapat Perkapita, Pembangunan Ekonomi yang meliputi berdiskusi, mempelajari, mengamati, maupun\r\nmembaca teorinya', 'b1a3f69b-8954-303e-a2fe-536dcb49d43a');
INSERT INTO `soal_tmi` VALUES (23, 21, '<ul><li>Mengikuti pelatihan cara merawat orang sakit. </li><li>Bisa menjelaskan yang dilakukan jika ada yang demam. </li><li>Senang mempelajari kiat agar tubuh menjadi sehat dan bugar.</li></ul>', 'ILMU_ALAM', 'KEPERAWATAN', 'Menyenagi kegiatan Perawatan Tubuh Manusia, tercermin pada tau bagaimana\r\nmerawat tubuh jika sakit, bisa memberikan rekomendasi jika (demam, pileks, batuk), tau bagaimana\r\nmembuat tubuh supaya sehat dan segar.', '313be06d-e34a-3a09-9e69-707cc5ca2e90');
INSERT INTO `soal_tmi` VALUES (24, 22, '<ul><li>Senang mendengarkan curahan hati teman.</li><li>Menghadiri seminar memahami diri sendiri dan orang lain. </li><li>Membaca hal tentang kepribadian, jiwa, emosi, dan motivasi.&nbsp;</li></ul>', 'ILMU_SOSIAL', 'PSIKOLOGI', 'Menyenangi sesuatu berhubungan dengan Diri Pribadi atau Jiwa Manusia, seperti: emosi,\r\njiwa, karakter, kepribadian, motivasi meliputi berdiskusi, mempelajari, mendengarkan maupun mengamati\r\nperilaku orang lain.', '609ddcfd-f9ec-37de-aa28-9f542b3c7123');
INSERT INTO `soal_tmi` VALUES (25, 23, '<ul><li>Mengukur luas bidang suatu lokasi. </li><li>Tim peneliti pola keruangan suatu wilayah. </li><li>Membantu pemetaan tanah untuk dijadikan lahan.</li></ul>', 'ILMU_ALAM', 'GEODESI', 'Menyenangi berhubungan dengan Pola Keruangan suatu Wilayah untuk dipetakan demi\r\nmelakukan keperluan berikutnya baik untuk lahan pertanian, perumahan, pengembangan wilayah maupun\r\neksplorasi hasil bumi.', '509b9110-6490-3798-a58f-4c8b8eb1d79e');
INSERT INTO `soal_tmi` VALUES (26, 24, '<ul><li>Tim penampil drama pada suatu acara. </li><li>Mengikuti pelatihan pembuatan naskah drama. </li><li>Menjadi sutradara (pengarah acara) sebuah pertunjukan.</li></ul>', 'ILMU_SOSIAL', 'SENI DRAMA', 'Menyenangi sesuatu yang berhubungan dengan Seni Drama yang tercermin pada kegiatan\r\nmenonton pertunjukkan, bermain drama, membuat naskah maupun menyutradarai suatu pertunjukkan seni.', 'e4bc53de-d7e5-337f-9db8-34c95b9cca5e');
INSERT INTO `soal_tmi` VALUES (27, 25, '<ul><li>Mempelajari cara membuat robot elektronik. </li><li>Menghadiri seminar teknologi terbaru HP, TV, atau laptop. </li><li>Tim pembuat aliran listrik dari air terjun, sungai, atau angin.</li></ul>', 'ILMU_ALAM', 'ELEKTRIK', 'Menyenangi berhubungan dengan Teknologi Kelistrikan, tercermin pada kegiatan membaca,\r\nmempelajari, berdiskusi maupun bereksperimen hal berhubungan dengan energi listrik, seperti: robot, aliran\r\nlistrik, HP, radio maupun TV.', 'd049389c-8ec9-3a6e-9c21-dd799a5c261f');
INSERT INTO `soal_tmi` VALUES (28, 26, '<ul><li>Menghadiri seminar peta kekuatan partai saat ini. </li><li>Bisa menjelaskan strategi terpilih menjadi anggota dewan. </li><li>Berdiskusi siapa yang bisa dijadikan bupati/walikota/gubernur.</li></ul>', 'ILMU_SOSIAL', 'POLITIK', 'Menyenangi sesuatu berhubungan dengan Dunia Perpolitikan, seperti: partai politik, pemilu,\r\npilkada, maupun strategi politik yang meliputi berdiskusi, mengamati, mempelajari maupun ikut kegiatan\r\npolitik praktis.', 'c9a03911-571c-3308-848e-9473b39db17f');
INSERT INTO `soal_tmi` VALUES (29, 27, '<ul><li>Tim pembuat pupuk bagi ketahanan karet. </li><li>Menghadiri pelatihan cara menanam sawit. </li><li>Senang berdiskusi cara merawat dan memetik cengkeh.</li></ul>', 'ILMU_ALAM', 'PERKEBUNAN', 'Menyenangi yang berhubungan Tanaman Perkebunan, seperti: sawit, cengkeh, karet yang\r\ntercermin pada kegiatan mempelajarinya, bereksperimen dalam pengembangbiakan – membuat antibiotik\r\nmaupun pupuk.', '891526cf-cdd6-3a28-a27c-52fe33303524');
INSERT INTO `soal_tmi` VALUES (30, 28, '<ul><li>Membaca tradisi asli Indonesia. </li><li>Senang berdiskusi tentang suku-suku pedalaman. </li><li>Menghadiri kampanye melestarikan budaya leluhur kita</li></ul>', 'ILMU_SOSIAL', 'ANTROPOLOGI', 'Menyenangi berhubungan dengan Budaya Tradisional Indonesia, baik itu suku\r\npedalaman, kesenian, alat maupun cara tradisional yang meliputi mempelajari, berdiskusi, kampanye,\r\nmaupun suvey lapangan.', '67447a6e-a6d0-3489-8581-4a54b281857c');
INSERT INTO `soal_tmi` VALUES (31, 29, '<ul><li>Tim pengelola website.</li><li>Membuat aplikasi, seperti: Facebook, Office, Windows. </li><li>Mengikuti pelatihan menggunakan bahasa pemograman tebaru.&nbsp;</li></ul>', 'ILMU_ALAM', 'SOFTWARE  IT', 'Menyenangi sesuatu berhubungan Perangkat Lunak Komputer, seperti: bahasa\r\npemograman, pembuatan aplikasi, pembuatan situs meliputi berdiskusi, mempelajari, menghadiri seminar\r\nmaupun membuat aplikasi.', '14323778-2b21-30ed-ad7d-2ba34ce63092');
INSERT INTO `soal_tmi` VALUES (32, 30, '<ul><li>Ingin mengetahui lebih banyak tentang perpajakan. </li><li>Berdiskusi tentang cara mengoptimalkan pemasukan daerah. </li><li>Menghadiri seminar tentang Rancangan Anggaran Pendapatan Negara.</li></ul>', 'ILMU_SOSIAL', 'FISKAL', 'Menyenangi sesuatu berhubungan dengan Pendapatan-Pemasukan Negara, seperti: pajak,\r\npembuatan anggaran, penerimaan negara bukan pajak yang kegiatannya meliputi berdiskusi, mempelajari,\r\nmembaca maupun magang', '1f17a594-060b-3382-b952-aa0c1813ae7f');
INSERT INTO `soal_tmi` VALUES (33, 31, '<ul><li>Tim pembuat antibiotik tubuh manusia. </li><li>Meneliti khasiat jahe, kunyit, atau temulawak bagi kesehatan. </li><li>Senang mempelajari tanaman, bahan, dan sesuatu yang bisa dijadikan obat</li></ul>', 'ILMU_ALAM', 'FARMASI', 'Menyenangi berhubungan dengan Obat-Obatan, seperti: antibiotik, bahan dijadikan obat,\r\njamu, khasiat dari rempah yang tercermin dalam mempelajari, berdiskusi maupun melakukan penelitian', '7fc4e8fb-fb75-3c06-b196-ec226ec2b6be');
INSERT INTO `soal_tmi` VALUES (34, 32, '<ul><li>Mengikuti pelatihan berbicara di hadapan khalayak ramai. </li><li>Menjadi moderator, MC, atau juru bicara pada suatu kegiatan. </li><li>Menjelaskan tips berkomunikasi sesuai karakter orang, waktu, dan keadaan.</li></ul>', 'ILMU_SOSIAL', 'KOMUNIKASI', 'Menyenangi aktivitas Komunikasi Massa, menyampaikan informasi dengan khalayak\r\nramai secara lisan tercermin pada kegiatan berbicara di depan umum, menjadi moderator, MC suatu kegiatan\r\natau juru bicara.', '6e7d26e8-0e63-3d44-a02c-dc022af4897d');
INSERT INTO `soal_tmi` VALUES (35, 33, '<ul><li>Tim pembuat aliran listrik dari tenaga uap. </li><li>Menghadiri seminar pemanfaatan energi panas bumi. </li><li>Menjadi bagian tim pembuat alat pendeteksi gempa bumi.</li></ul>', 'ILMU_ALAM', 'GEOFISIKA', 'Menyenangi berhubungan dengan Pemanfaatan Fisika pada Kebumian, seperti: panas bumi,\r\ntenaga uap, alat pendeteksi gempa bumi meliputi berdiskusi, mempelajari, bereksperimen maupun survey\r\nlapangan.', '1860ef3d-b456-31b5-ad10-d7b43314a251');
INSERT INTO `soal_tmi` VALUES (36, 34, '<ul><li>Tim penampil tarian di suatu acara. </li><li>Ingin mempelajari tari kreasi baru, tradisional maupun modern. </li><li>Bersedia mengajarkan tarian yang dikuasai ke anak-anak usia dini.</li></ul>', 'ILMU_SOSIAL', 'SENI TARI', 'Menyenangi sesuatu berhubungan dengan Seni Tari tercermin pada mempelajari, menonton,\r\nmembuat tarian, menari, maupun mengajarkan tarian pada orang lain baik tradisional, modern maupun\r\nbarat.', '4ff55287-3b0b-396a-9a83-cc35bebe4dc0');
INSERT INTO `soal_tmi` VALUES (37, 35, '<ul><li>Senang mengotak-atik benda elektronik tertentu. </li><li>Bisa menjelaskan fungsi benda elektronik tertentu. </li><li>Berpartisipasi pada pelatihan memperbaiki TV atau kulkas yang rusak.</li></ul>', 'ILMU_ALAM', 'TEKNIS LISTRIK', 'Memiliki ketertarikan pada Applikasi Praktis Kelistrikan tercermin pada memahami\r\nfungsi/nama benda elektrik, mengotak-ngatiknya, serta bisa memperbaiki TV, kulkas, setrika, lampu, radio\r\natau tape rusak', '6883a25c-a9de-32cb-940e-8418a6ea6019');
INSERT INTO `soal_tmi` VALUES (38, 36, '<ul><li>Menghadiri diskusi tentang Amandemen UUD 1945.</li><li>Tim pembuat perjanjian antar kelompok yang bertikai. </li><li>Membuat rumusan hukuman bagi pelanggaran suatu peraturan</li></ul>', 'ILMU_SOSIAL', 'HUKUM', 'Menyenangi berhubungan dengan Dunia Hukum, seperti: undang-undang, perjanjian\r\nantarkelompok, peraturan tidak tertulis, hukum perdata – pidana – internasional meliputi berdiskusi,\r\nmengamati, mempelajari, kegiatan praktis', '9291d1e1-900a-3a4a-9b78-6780a1ed2be4');
INSERT INTO `soal_tmi` VALUES (39, 37, '<ul><li>Tim pembudidaya pohon untuk tanaman hutan. </li><li>Menghadiri seminar tentang memanfaatkan hasil-hasil alam. </li><li>Senang mempelajari cara melestarikan hutan-hutan Indonesia</li></ul>', 'ILMU_ALAM', 'KEHUTANAN', 'Menyenangi berhubungan dengan Kehutanan, tercermin pada berdiskusi, mempelajari\r\nmaupun melakukan eksperimen tentang budidaya tanaman, pengolahan hasil, manajemen maupun\r\npelestarian hutan', '2042f64c-882f-3327-bfa1-0a622d885701');
INSERT INTO `soal_tmi` VALUES (40, 38, '<ul><li>Menghadiri kampanye melestarikan bahasa daerah. </li><li>Tim pengumpul karya sastra suatu bahasa tradisional. </li><li>Mempelajari bahasa Nusantara, seperti : Jawa, Minahasa, Papua, Melayu</li></ul>', 'ILMU_SOSIAL', 'BAHASA NUSANTARA', 'Menyenangi berhubungan dengan Bahasa Daerah di Indoesia, seperti: bahasa\r\nJawa, bahasa Batak, bahasa Sunda, bahasa Melayu, bahasa Minang yang meliputi pengucapan, tata bahasa maupun karya sastra', '40e7a5d5-a0d2-3df8-81d0-8b454e43c23f');
INSERT INTO `soal_tmi` VALUES (41, 39, '<ul><li>Mengikuti pelatihan membuat jaringan antar komputer. </li><li>Mengamati teknologi terkini motherboard, memory, dan harddisk. </li><li>Tim pembuat jaringan internet dari panci untuk kepentingan warga.</li></ul>', 'ILMU_ALAM', 'HARDWARE IT', 'Menyenagi sesuatu berhubungan Perangkatan Keras IT, seperti: jaringan internet,\r\nRAM, modem, motherboard, CPU, pemancar sinyal meliputi kegiatan mempelajari, berdiskusi, bereksperimen\r\nmaupun merakitnya.', 'a366060a-1c3a-336f-a054-b123484a3115');
INSERT INTO `soal_tmi` VALUES (42, 40, '<ul><li>Tim pemeriksa laporan keuangan suatu instansi. </li><li>Senang terhadap sesuatu yang berhubungan dengan Akuntansi. </li><li>Menghadiri seminar tentang tata cara pembuatan suatu anggaran</li></ul>', 'ILMU_SOSIAL', 'AKUNTANSI', 'Menyenangi sesuatu berhubungan dengan Akuntansi, seperti: pelajaran Akuntansi, proses\r\npengauditan, pembuatan anggaran meliputi mempelajari, berdiskusi, membuatnya maupun ikut kegiatan\r\nmagang di suatu instansi.', 'd30e0442-8fea-3ddc-8abe-e1e627e03f8e');
INSERT INTO `soal_tmi` VALUES (43, 41, '<ul><li>Tim peneliti kandungan nutrisi dalam sayuran, buahan, dan daging. </li><li>Menghadiri seminar tentang memilih makanan sesuai kebutuhan tubuh. </li><li>Mempelajari tentang manfaat protein, karbohidrat, vitamin, dan mineral</li></ul>', 'ILMU_ALAM', 'GIZI', 'Menyenangi berhubungan dengan Gizi/Nutrisi bagi tubuh, tercermin pada mempelajari, berdiskusi,\r\nbereksperimen kandungan (protein, vitamin, omega 3, karbohidrat, zat besi) dari sayuran, daging maupun\r\nbuah-buahan', '8be98230-b03f-3491-8d2c-f04e6df2a55a');
INSERT INTO `soal_tmi` VALUES (44, 42, '<ul><li>Bersedia saat diminta menjadi asisten guru TK. </li><li>Senang bermain, bercerita, dan mengasuh anak-anak kecil. </li><li>Menghadiri seminar tentang tumbuh kembang anak usia dini.</li></ul>', 'ILMU_SOSIAL', 'DUNIA ANAK', 'Menyenangi sesuatu berhubungan dengan Dunia Anak-Anak tercermin pada kegiatan\r\nbermain, berdiskusi, mengasuh anak-anak, mengajarkan sesuatu, mengoptimalkan potensinya serta\r\nkampanye kepeduliannya', 'e6d844f3-951a-3df6-b0b0-e7b1112cd7e3');
INSERT INTO `soal_tmi` VALUES (45, 43, '<ul><li>Tim peneliti kandungan gas di suatu lokasi.</li><li>Menghadiri seminar cadangan minyak Indonesia. </li><li>Mempelajari pembentukan dan eksplorasi minyak bumi.&nbsp;</li></ul>', 'ILMU_ALAM', 'PERMINYAKAN', 'Menyenangi berhubungan dengan Teknologi Perminyakan, meliputi cadangan minyak,\r\npembentukan dan eksplorasi minyak maupun gas alam yang meliputi berdiskusi, mempelajari, ikut kegiatan\r\nlapangan.', '404f9d16-6c6d-3420-9395-b49bd18655dd');
INSERT INTO `soal_tmi` VALUES (46, 44, '<ul><li>Mengikuti pelatihan pemotretan. </li><li>Mendatangi sebuah tempat untuk memotret sesuatu. </li><li>Berdiskusi tentang cara meningkatkan kualitas hasil foto</li></ul>', 'ILMU_SOSIAL', 'FOTO', 'Menyenangi sesuatu yang berhubungan dengan Fotograpi tercermin pada kegiatan pemotretan,\r\npengeditan hasil foto, melakukan atau menghadiri pameran foto, pengenalan dan koleksi terhadap alat-alat\r\nfotograpi.', '1e5cab38-b95e-34d8-99f7-b5739116fa3e');
INSERT INTO `soal_tmi` VALUES (47, 45, '<ul><li>Mempelajari teknologi sepeda motor. </li><li>Senang diajak membuat sepeda elektronik. </li><li>Mengikuti pelatihan membuat mesin mobil yang canggih</li></ul>', 'ILMU_ALAM', 'TEKNOLOGI MOTOR', 'Menyenangi berhubungan Teknologi Kendaraan Bermotor, seperti: mobil,\r\nmotor, sepeda elektronik tercermin pada berdiskusi, mempelajari, membaca, bereksperimen, menghadiri\r\nseminar – pameran.', 'e1c44f7e-f2f1-3ccd-b28e-5669c8a44764');
INSERT INTO `soal_tmi` VALUES (48, 46, '<ul><li>Tim penyelidik suatu kasus pencurian. </li><li>Belajar cara mengungkap dalang pada sebuah kejahatan. </li><li>Berdiskusi tentang mencegah tindakan kriminal dalam masyarakat.&nbsp;</li></ul>', 'ILMU_SOSIAL', 'KRIMINAL', 'Menyenangi sesuatu berhubungan dengan Dunia Pengungkapan Peristiwa Kriminal\r\nmeliputi mempelajari, berdiskusi, terlibat pada kegiatan pencegahan-penanganan kejahatan tradisional, cyber\r\nmaupun birokrasi.', '853cd8f2-7510-3fc8-82ad-46de0520861a');
INSERT INTO `soal_tmi` VALUES (49, 47, '<ul><li>Membaca tentang alat-alat pertanian.</li><li>Tim peneliti metode perawatan hasil pertanian pascapanen. </li><li>Menghadiri seminar tentang teknologi terbaru pengolahan lahan pertanian.&nbsp;</li></ul>', 'ILMU_ALAM', 'TEKNIK PERTANIAN', 'Menyenangi berhubungan Teknologi Pertanian, tercermin pada pengolahan lahan\r\npertanian, alat-alat pertanian, merawat hasil pertanian pascapanen meliputi mempelajari, berdiskusi\r\nmaupun bereksperimen', 'ce201916-72e1-3a12-b664-b372138ab4d3');
INSERT INTO `soal_tmi` VALUES (50, 48, '<ul><li>Bersedia menjadi tur guide ke suatu tempat. </li><li>Berkunjung ke tempat-tempat menarik di Indonesia. </li><li>Berdiskusi tentang cara menarik turis untuk berlibur ke Indonesia</li></ul>', 'ILMU_SOSIAL', 'KEPARIWISATAAN', 'Menyenangi sesuatu berhubungan Kepariwisataan tercermin pada kegiatan\r\nperjalanan wisata, memiliki niat untuk mengembangkan kepariwisataan, menjadikan aset alam-budaya\r\nsebagai asset pariwisata.', '16767765-4868-3be1-bb89-9d4935a1e3cc');
INSERT INTO `soal_tmi` VALUES (51, 49, '<ul><li>Mempelajari desain bangunan, seperti: rumah, gedung, jembatan, stadion. </li><li>Menghadiri pelatihan membuat desain tempat, seperti : taman kota, jogging track, area bermain anak. </li><li>Menjadi tim perancang gambar kompleks bangunan, seperti: perkantoran, sekolah, pusat perbelanjaan</li></ul>', 'ILMU_ALAM', 'ARSITEKTUR', 'Menyenangi sesuatu berhubungan Seni Perancangan Bangunan, seperti: rumah, gedung,\r\nkompleks perkantoran, perumahan, jembatan, taman kota tercermin pada kegiatan mempelajari, berdiskusi,\r\nmembuat desain', '1715ee8d-c056-3fef-8e1b-5206792e5092');
INSERT INTO `soal_tmi` VALUES (52, 50, '<ul><li>Mempelajari mengelola keuangan yang efektif dan efisien</li><li>Menghadiri seminar tentang mengoptimalkan pemasukan. </li><li>Senang sesuatu yang berhubungan dengan perencanaan pembiayaan.</li></ul><br>', 'ILMU_SOSIAL', 'KEUANGAN', 'Menyenangi sesuatu berhubungan Perencanaan Keuangan; mengelola keuangan yang\r\nefektif dan efisien; memaksimalkan pendapat dan meminimalkan pengeluaran meliputi mempelajari,\r\nberdiskusi, mengikuti pelatihan.', '239a56d7-fef3-3f48-b77c-37a37eeb146e');
INSERT INTO `soal_tmi` VALUES (53, 51, '<ul><li>Senang mempelajari pola hidup sehat. </li><li>Menjadi tim pendata kebersihan suatu lingkungan. </li><li>Menyosialisasikan masyarakat agar lebih banyak mengonsumsi sayuran</li></ul>', 'ILMU_ALAM', 'KESEHATAN MASYARAKAT', 'Menyenangi berhubungan dengan Kesehatan Publik, seperti: kebersihan\r\nlingkungan, keselamatan kerja, konsumsi air-buah-sayuran, kesadaran hidup sehat terwujud mempelajari,\r\nberdiskusi, kampanye.', '03df3827-1b21-3dc4-b390-a2c883495e37');
INSERT INTO `soal_tmi` VALUES (54, 52, '<ul><li>Membuat rumah singgah bagi anak yang tidak beruntung. </li><li>Senang mempelajari tentang anak autis, ADHD, tunanetra, dll. </li><li>Sosialiasi menyadarkan masyarakat tentang anak berkebutuhan khusus.</li></ul>', 'ILMU_SOSIAL', 'ANAK BERKEBUTUHAN KHUSUS', 'Menyenangi berhubungan dengan Anak Berketubuhan Khusus, seperti: autis, retardasi mental, hiperaktif, downsyndrome, tuna netra meliputi berdiskusi, mempelajari,\r\nmengasuh maupun berkampanye', '3199e944-4d9b-309f-b249-c16600cec70e');
INSERT INTO `soal_tmi` VALUES (55, 53, '<ul><li>Tim peneliti kadar batubara di suatu lokasi. </li><li>Menghadiri seminar tentang kekayaan sumber daya mineral Indonesia. </li><li>Mempelajari pembentukan dan eksplorasi emas, timah, nikel, dan besi.</li></ul>', 'ILMU_ALAM', 'MINERAL TAMBANG', 'Menyenangi tentang Mineral Tambang, seperti : kandungan sumber daya\r\nmineral, pembentukan - eksplorasi (emas, timah, besi, nikel, magan, batubara) meliputi berdiskusi,\r\nmempelajari, ikut kegiatan lapangan.', '1a1e0406-1fa8-3040-b52d-9f71a9ca5771');
INSERT INTO `soal_tmi` VALUES (56, 54, '<ul><li>Tim pembuat film dokumenter. </li><li>Menjadi sutradara suatu film pendek. </li><li>Mengikuti pelatihan cara membuat naskah film.&nbsp;</li></ul>', 'ILMU_SOSIAL', 'FILM', 'Menyenangi sesuatu yang berhubungan dengan dunia Perfilman yang tercermin pada pembuatan\r\nfilm, berdiskusi film terbaru, membuat film dokumenter, maupun tergerak untuk menjadi sutradara atau\r\nkritikus sinema.', 'b8ba20e4-4578-3702-913b-1bf68ac93c46');
INSERT INTO `soal_tmi` VALUES (57, 55, '<ul><li>Senang memodifikasi motor. </li><li>Bisa menjelaskan fungsi komponen kendaraan bermotor. </li><li>Mengikuti pelatihan memperbaiki mobil yang bermasalah</li></ul>', 'ILMU_ALAM', 'MONTIR', 'Menyenangi Kegiatan Montir yang tercermin pada kegiatan memperbaiki kendaraan yang\r\nrusak, memodifikasi kendaraan maupun memahami fungsi dari mesin-mesin kendaraan terutama motor,\r\nmobil dan sepeda.', 'a4b567f7-60cd-3e63-ae86-a48337a9e7c9');
INSERT INTO `soal_tmi` VALUES (58, 56, '<ul><li>Mempelajari dunia kedetektifan. </li><li>Menghadiri pelatihan menjadi intelijen. </li><li>Disusupkan sebagai agen rahasia ke suatu lokasi.</li></ul>', 'ILMU_ALAM', 'INTELIJEN', 'Menyenangi sesuatu berhubungan dengan Dunia Inteligen - dunia bagaimana mengumpulkan\r\ninformasi penting demi kepentingan negara, meliputi mempelajari, berdiskusi maupun menjadi inteligen ke\r\nsebuah tempat', '6c972d08-6a62-3f0f-a517-3604d1f69ab3');
INSERT INTO `soal_tmi` VALUES (59, 57, '<ul><li>Tim peneliti ekosistem di suatu pantai. </li><li>Menghadiri seminar tentang pemanfaatan hasil-hasil laut.</li><li>Mempelajari berbagai hal tentang biota-biota di dasar laut.</li></ul>', 'ILMU_ALAM', 'KELAUTAN', 'Menyenangi berhubungan dengan Kelautan tercermin minat pada biota laut, ekosistemnya,\r\npemanfaatan hasil laut, pengelolaan laut yang meliputi membaca, berdiskusi maupun melakukan penelitian', '6811faf2-fc8b-32c2-9abb-f50b3be5813a');
INSERT INTO `soal_tmi` VALUES (60, 58, '<ul><li>Tim peneliti fakta di balik sebuah peristiwa. </li><li>Menghadiri seminar asal usul nenek moyang bangsa Indonesia. </li><li>Membaca tentang Peradaban Yunani, Romawi, Persia, India, dan Cina</li></ul>', 'ILMU_SOSIAL', 'SEJARAH', 'Menyenangi sesuatu berhubungan dengan Peristiwa Penting Pada Masa Lampau baik kisah,\r\nbenda, kebudayan, seni tercermin pada kegiatan mempelajari, berdiskusi, seminar maupun kegiatan\r\npenelitian.', 'da24f39a-8f7e-3952-ac86-a65e00e3571e');
INSERT INTO `soal_tmi` VALUES (61, 59, '<ul><li>Berdiskusi memperbaiki tata kota yang semrawut. </li><li>Mempelajari cara pengelolaan sebuah kawasan agar lebih maju. </li><li>Tim pendata lokasi sarana dan prasarana untuk daerah yang baru.&nbsp;</li></ul>', 'ILMU_ALAM', 'PLANOLOGI', 'Menyenangi berhubungan Perencanan Suatu Kota, Wilayah maupun Kawasan baik\r\nbersifat fisik, sosial, budaya, maupun ekonomi tercermin pada lokasi sarana prasarana, tata kota maupun\r\npembangunan berkelanjutan.', '7a29791c-a1cb-3d27-8126-ac9a136218c3');
INSERT INTO `soal_tmi` VALUES (62, 60, '<ul><li>Menghadiri seminar perbankan di Indonesia. </li><li>Senang diajarkan pemberian pinjaman atau kredit di bank. </li><li>Bisa menjelaskan sedikit tentang valuta asing, kurs, dan deposito</li></ul>', 'ILMU_SOSIAL', 'PERBANKAN', 'Menyenangi sesuatu berhubungan dengan Dunia Perbankan, seperti: valuta asing, kurs,\r\ntabungan, deposito yang kegiatan meliputi berdiskusi, mempelajari, melakukan kegiatan praktik maupun\r\nikut kegiatan pelatihan.', '2e601f5a-ab12-353a-bcc3-1264f64f54b5');
INSERT INTO `soal_tmi` VALUES (63, 61, '<ul><li>Ingin mengetahui lebih banyak tentang alat kedokteran gigi. </li><li>Mempelajari cara memelihara gigi supaya sehat, kuat, dan bersih. </li><li>Menghadiri seminar mengenali dan mengobati penyakit gusi dan mulut</li></ul>', 'ILMU_ALAM', 'KEDOKTERAN GIGI', 'Menyenangi berhubungan dengan Kesehatan Gigi, Gusi maupun Mulut, tercermin\r\npada kegiatan mengenali, mencegah, mengobati penyakit gigi dan mulut, membuat gigi sehat- kuat - bersih\r\nserta pengetahuan alatnya', 'cf69cce8-aec1-396b-84e9-48a95688affe');
INSERT INTO `soal_tmi` VALUES (64, 62, '<ul><li>Kampanye penanaman minat baca sejak dini. </li><li>Berdiskusi tentang cara meningkatkan semangat belajar. </li><li>Menghadiri seminar peningkatkan kualitas pendidikan Indonesia.</li></ul>', 'ILMU_SOSIAL', 'PENDIDIKAN', 'Menyenangi berhubungan dengan Dunia Pendidikan, seperti: strategi belajar, semangat\r\nbelajar maupun peningkatan kualitas pendidikan yang kegiatan meliputi berdiskusi, mempelajari, mengajar,\r\nmaupun kampanye kepedulian', '833ba081-1001-3130-ae9c-dcb9a1b58fd9');
INSERT INTO `soal_tmi` VALUES (65, 63, '<ul><li>Tim pengolah alumunium menjadi benda pakai. </li><li>Mempelajari pengolahan perak, tembaga, besi menjadi benda ½ jadi. </li><li>Menghadiri seminar tentang pengolahan plastik, keramik, dan timah.</li></ul>', 'ILMU_ALAM', 'METALAURGI', 'Menyenangi berhubungan dengan Teknologi Pengolahan Benda Metal seperti: perak,\r\nmangan, besi, alumunium, timah menjadi benda ½ jadi maupun benda jadi meliputi berdiskusi, mempelajari,\r\nmembuat maupun bereksperimen', '61e06d24-b0b9-36d5-92d4-e98ef13423fd');
INSERT INTO `soal_tmi` VALUES (66, 64, '<ul><li>Menjadi editor suatu majalah.</li><li>Mengikuti pelatihan menjadi reporter. </li><li>Magang di stasiun radio atau televisi lokal</li></ul>', 'ILMU_SOSIAL', 'JURNALISTIK', 'Menyenangi sesuatu yang berhubungan dengan Dunia Jurnalistik, seperti: peliputan\r\nberita, penyiaran berita, menjadi reporter maupun pengauditan berita di suatu majalah, bulletin, koran,\r\nstasiun TV, stasiun radio.', '1e09e815-d1f5-37a4-971c-823f920ad661');
INSERT INTO `soal_tmi` VALUES (67, 65, '<ul><li>Tim pembuat alat penyaring air. </li><li>Senang diajak membuat alat pengolah sampah. </li><li>Memikirkan pembuatan mesin yang bermanfaat bagi kehidupan.</li></ul>', 'ILMU_ALAM', 'MESIN PRODUKSI', 'Menyenangi aktivitas membuat Mesin produksi(mesin bermanfaat bagi kehidupan)\r\nseperti: mesin pengolahan sampah, alat penyaring air, alat pengolah makanan, alat pembersih, alat pencetak,\r\nalat pengecat.', '5549ae44-08ad-39c1-818c-a082ae82edcf');
INSERT INTO `soal_tmi` VALUES (68, 66, '<ul><li>Pemecah misteri suatu petunjuk. </li><li>Senang diajarkan cara memecahkan kode tertentu. </li><li>Menghadiri pelatihan membaca makna simbol, huruf, dan angka</li></ul>', 'ILMU_ALAM', 'SANDI', 'Menyenangi berhubungan dengan Kode-Kode Rahasia dari suatu simbol, huruf maupun angka yang kegiatannya meliputi mempelajari, membaca, berdiskusi maupun ikut kegiatan pembuatan atau\r\npemecahan sandi.', '3ea1a61c-6a8c-3d99-8800-9f50fc8d37be');
INSERT INTO `soal_tmi` VALUES (69, 67, '<ul><li>Sosialisasi menyelamatkan bumi dari pemanasan global. </li><li>Mempelajari keanekaragaman hayati dalam suatu ekosistem. </li><li>Tim pemeriksa kondisi tanah, air, dan udara di daerah tertentu</li></ul>', 'ILMU_ALAM', 'EKOSISTEM', 'Menyenangi berhubungan dengan Ekosistem Hayati berupa mempelajari, berdiskusi,\r\nberkampanye maupun melakukan eksperimen yang berhubungan dengan tanah, air, udara maupun makhluk\r\nhidup di suatu ekosistem', 'e0f2d045-4996-3c7b-96a1-2c9fe463f6e8');
INSERT INTO `soal_tmi` VALUES (70, 68, '<ul><li>Meneliti sebuah candi. </li><li>Mempelajari manusia purba beserta kehidupannya. </li><li>Tim pengeksplorasi keberadaan arca, mumi, atau barang antik.</li></ul>', 'ILMU_SOSIAL', 'ARKEOLOGI', 'Menyenangi sesuatu berhubungan dengan Benda-Benda Bersejarah (Kuno), seperti:\r\nmanusia purba, candi, artefak, mummi, sarkofagus yang kegiatan meliputi mempelajari, berdiskusi maupun\r\nikut penelitian lapangan', '1118ffad-c0b1-37e4-b972-5314fe783db3');
INSERT INTO `soal_tmi` VALUES (71, 69, '<ul><li>Tim pembuat rumah tahan gempa. </li><li>Mempelajari cara, alat, dan bahan untuk membuat bangunan. </li><li>Berdiskusi cara pembuatan jalan, irigasi, bendungan, atau bandara</li></ul>', 'ILMU_ALAM', 'TEKNIK SIPIL', 'Menyenangi sesuatu berhubungan dengan Teknologi Konstruksi Bangunan yang\r\ntercermin pada cara, alat, proses maupun bahan yang digunakan untuk membuat rumah, jembatan, irigasi,\r\nbendungan, jalan, bandara, dll.', 'b9181631-fec6-3ab6-93dd-2caad07444da');
INSERT INTO `soal_tmi` VALUES (72, 70, '<ul><li>Mengikuti pelatihan mendekorasi panggung suatu acara. </li><li>Mempelajari cara mendesain sebuah ruangan supaya menarik. </li><li>Bisa memberikan rekomendasi tata letak benda di suatu tempat.</li></ul>', 'ILMU_SOSIAL', 'DESAIN INTERIOR', 'Menyenangi kegiatan berhubungan dengan Seni Desain Dalam Bangunan, seperti:\r\nmerias ruangan, mendekorasi panggung, mengecat suatu bangunan, maupun mengatur tata letak bendabenda supaya menarik dan elegan.', '3299bc75-ec98-3faa-8189-b0a7fb2ab897');
INSERT INTO `soal_tmi` VALUES (73, 71, '<ul><li>Tim peneliti manfaat suatu bakteri. </li><li>Mempelajari tentang sel, mikroba, dan virus. </li><li>Menghadiri seminar tentang temuan terbaru kromosom</li></ul>', 'ILMU_ALAM', 'MIKROORGANISME', 'Menyenagi sesuatu berhubungan Mikrobiologi (Organisme), seperti: bakteri,\r\nvirus, kromosom, mikroba, sel tercermin pada mempelajari, menghadiri seminar, bereskperimen, berdiskusi,\r\nmelakukan penelitian.', 'bfabb9a0-6a74-34a5-99d8-66dfabe09b94');
INSERT INTO `soal_tmi` VALUES (74, 72, '<ul><li>Terlibat aktif di suatu organisasi. </li><li>Menghadiri pelatihan kepemimpinan. </li><li>Membuat perencanaan, pelaksanaan, dan pengevaluasian.</li></ul>', 'ILMU_SOSIAL', 'MANAJEMEN', 'Menyenangi berhubungan dengan Manajemen tercermin pada kegiatan membuat -\r\nmelakukan - mengevaluasi sebuah perencanaan, terlibat aktif dalam organisasi serta sesuatu berhubungan\r\ndengan kepemimpinan.', '26f41978-d027-3d9b-a89b-917ff68c3cc2');
INSERT INTO `soal_tmi` VALUES (75, 73, '<ul><li>Tim peneliti rantai karbon. </li><li>Melakukan eksperimen tentang jalur reaksi suatu senyawa. </li><li>Menghadiri seminar tentang temuan terbaru sistem unsur periodik.</li></ul>', 'ILMU_ALAM', 'KIMIA DASAR', 'Menyenangi Dasar Ilmu Kimia, seperti: rantai karbon, sistem periodik unsur, proton,\r\nneutron, molekur yang kegiatan meliputi mempelajari, berdiskusi, menghadiri seminar maupun melakukan\r\neksperimen di bidang kimia.', '5f1e1c03-5ed2-3470-b4c4-94f704ec88f2');
INSERT INTO `soal_tmi` VALUES (76, 74, '<ul><li>Senang berkunjung ke perpustakaan. </li><li>Tim penyusun buku berdasarkan nomor urut di perpustakaan. </li><li>Berdiskusi tentang pengoptimalan perpustakaan agar ramai dikunjungi</li></ul>', 'ILMU_SOSIAL', 'PERPUSTAKAAN', 'Menyenangi sesuatu berhubungan dengan Dunia Perpustakaan meliputi senang\r\nberkunjung, membuat strategi supaya berkunjung maupun membantu pembuatan kode buku di\r\nperpustakaan.', '96d059c9-0a47-354e-904f-a2b3086be0e2');
INSERT INTO `soal_tmi` VALUES (77, 75, '<ul><li>Tim pembuat speed boat elektronik. </li><li>Mempelajari sistem mesin perkapalan. </li><li>Menghadiri seminar teknologi terkini kapal selam.</li></ul>', 'ILMU_ALAM', 'TEKNOLOGI KAPAL', 'Menyenangi berhubungan dengan Teknologi Perkapalan, tercermin pada\r\nmempelajari, berdiskusi, penelitian, melakukan eksperimen berhubungan dengan mesin dan desain kapal\r\nbaik pesiar, boat, tempur.', 'f74a32b8-a0bc-308b-be68-179fbaf86a21');
INSERT INTO `soal_tmi` VALUES (78, 76, '<ul><li>Menghadiri kegiatan Pramuka. </li><li>Berdiskusi meningkatkan rasa cinta tanah air pada generasi muda. </li><li>Bersemangat saat mendengarkan lagu Indonesia Raya berkumandang</li></ul>', 'ILMU_ALAM', 'BELA NEGARA', 'Menyenangi sesuatu berhubungan dengan Kecintaan terhadap Tanah Air tercermin\r\npada semangat mendengarkan lagu nasional, berpikir bagaimana membuat masyarakat cinta tanah air,\r\nmengampanyekan budaya nasional.', '5c5665c4-cbce-306f-83de-843862812bdb');
INSERT INTO `soal_tmi` VALUES (79, 77, '<ul><li>Senang membaca tentang prakiraan cuaca. </li><li>Tim peneliti tentang gerhana bulan/matahari. </li><li>Menghadiri seminar dampak perubahan iklim terhadap kehidupan.&nbsp;</li></ul>', 'ILMU_ALAM', 'METEOROLOGI', 'Menyenangi sesuatu berhubungan dengan Meteorologi, seperti: iklim, cuaca yang\r\nkegiatan meliputi berdiskusi, mempelajari, berkesperimen maupun berkunjung ke tempat kegiatan (badan\r\nmeteorologi).', '6c3e5afd-2c4c-3ab5-9e8c-b81665a9d29b');
INSERT INTO `soal_tmi` VALUES (80, 78, '<ul><li>Mendengarkan lagu/berita yang berbahasa asing tertentu. </li><li>Mengajarkan cara menuliskan kosakata dalam suatu bahasa asing. </li><li>Menghadiri pelatihan tentang berkomunikasi bahasa asing tertentu.</li></ul>', 'ILMU_SOSIAL', 'BAHASA ASING', 'Menyenangi sesuatu berhubungan dengan Bahasa Asing tertentu, tercermin pada: tata\r\nbahasa, berbicara, menulis, berdiskusi, memiliki kelengkapan pembelajaran seperti: CD, kaset, kamus,\r\nmajalah, buku teks', '778d8aea-788a-3961-9c68-bae77266368c');
INSERT INTO `soal_tmi` VALUES (81, 79, '<ul><li>Tim pembuat lingkungan bersih dan hijau. </li><li>Mempelajari cara membuat bangunan ramah lingkungan. </li><li>Menghadiri seminar tentang pembangunan berwawasan lingkungan</li></ul>', 'ILMU_ALAM', 'TEKNIK LINGKUNGAN', 'Menyenangi sesuatu berhubungan dengan Pelestarian Lingkungan dari Segi\r\nFisik tercermin pada kegiatan pembangunan berwawasan lingkungan, lingkungan yang bersih serta\r\nbangunan fisik ramah lingkungan', '3cc48abc-6c39-3fdd-8099-86af246760de');
INSERT INTO `soal_tmi` VALUES (82, 80, '<ul><li>Mendesain poster untuk suatu kegiatan. </li><li>Mengikuti pelatihan membuat film animasi. </li><li>Mempelajari cara membuat komik atau karikatur.&nbsp;</li></ul>', 'ILMU_SOSIAL', 'DESAIN VISUAL', 'Menyenangi kegiatan berhubungan dengan Seni Desain Visual, seperti: desain animasi,\r\npembuatan poster, pembuatan komik, pembuatan karikatur meliputi berdiskusi, mempelajari, membaca\r\nmaupun melakukan projek', '88d300e2-5d3d-3c8e-8702-0ad97adc7c62');
INSERT INTO `soal_tmi` VALUES (83, 81, '<ul><li>Tim pengembangbiakan hewan tertentu. </li><li>Senang memelihara atau merawat hewan tertentu.</li><li> Bisa menjelaskan bagian dan fungsi tubuh hewan tertentu.</li></ul>', 'ILMU_ALAM', 'ZOOLOGI', 'Menyenangi sesuatu berhubungan dengan Hewan tercermin pada kegiatan memelihara,\r\nmerawat, mempelajari, mengetahui fungsi tubuh hewan, berdiskusi, bereskperimen maupun melakukan\r\npenelitiannya.', 'bfa7dee5-3f67-3ae3-a7f5-90984524f2ed');
INSERT INTO `soal_tmi` VALUES (84, 82, '<ul><li>Memiliki cita-cita menjadi pelaut.</li><li>Senang diajak berlayar ke berbagai tempat.</li><li>Menghadiri pelatihan menjadi nahkoda kapal.</li></ul>', 'ILMU_ALAM', 'PELAUT', 'Menyenangi kegiatan yang berhubungan Pelaut yang tercermin pada memiliki cita-cita menjadi pelaut, mempelajari cara mengendarai kapal maupun ingin berkelilingng Indonesia atau dunia dengan kapal.', '69913e94-eb44-3dbc-87ba-34a203a9f43d');
INSERT INTO `soal_tmi` VALUES (85, 83, '<ul><li>Membuat suatu pupuk dari bahan tertentu. </li><li>Tim pengolah bubuk kertas dari kayu sehingga menjadi kertas. </li><li>Meneliti cara baru tentang pengolahan minyak mentah menjadi bensin.&nbsp;</li></ul>', 'ILMU_ALAM', 'KIMIA INDUSTRI', 'Menyenangi Applikasi Kimia pada Dunia Industri, seperti: pengolahan kayu menjadi\r\nkertas, pengolahan minyak mentah, maupun pembuatan pupuk kimia meliputi berdiskusi, mempelajari,\r\nmaupun bereksperimen.', 'dc660dd1-1181-3ce0-89b1-23f470ccb766');
INSERT INTO `soal_tmi` VALUES (86, 84, '<ul><li>Menjadi wasit pada suatu kejuaraan. </li><li>Mengikuti perlombaan suatu olahraga tertentu. </li><li>Bersedia menjadi pemandu pemanasan sebelum kegiatan</li></ul>', 'ILMU_SOSIAL', 'OLAHRAGA', 'Menyenangi olahraga tertentu, baik itu mempelajari, menjadi wasit, bermain maupun\r\nmengajarkannya pada orang lain – ada banyak waktu untuk mengerjakan, berdiskusi atau menonton hal\r\nberhubungan dengan olahraga.', 'b18a8d3d-63f5-398a-8c7f-583b767ef341');
INSERT INTO `soal_tmi` VALUES (87, 85, '<ul><li>Tim pembuat helikopter mini. </li><li>Mempelajari tentang mesin pesawat terbang. </li><li>Menghadiri seminar tentang teknologi terkini jet tempur.</li></ul>', 'ILMU_ALAM', 'TEKNOLOGI PESAWAT', 'Menyenangi berhubungan dengan Teknologi Pesawat, tercermin pada\r\nmempelajari, berdiskusi, bereksperimen, menghadiri seminar yang berhubungan teknologi helikopter,\r\npesawat, jet, maupun apollo', '47bec24e-f9b8-34f7-80a8-fae1444f0dcc');
INSERT INTO `soal_tmi` VALUES (88, 86, '<ul><li>Mengikuti pelatihan ala militer (wajib militer). </li><li>Menjadi pasukan cadangan jika Indonesia diserang. </li><li>Bersedia mengorbankan jiwa-raga demi bangsa dan negara.</li></ul>', 'ILMU_ALAM', 'MILITER', 'Menyenangi sesuatu berhubungan dengan Dunia Militer/Polisi, tercermin dalam siap\r\nmengorbankan jiwa raga demi keutuhan NKRI, bersedia menjadi pasukan cadangan serta senang mengikuti\r\npelatihan ala militer', '8c87d797-4546-3dd0-bb92-dbfdbbb97c65');
INSERT INTO `soal_tmi` VALUES (89, 87, '<ul><li>Tim peneliti UFO. </li><li>Mempelajari tentang bulan, bintang dan matahari. </li><li>Menghadiri seminar tentang temuan terbaru planet di tata surya</li></ul>', 'ILMU_ALAM', 'ASTRONOMI', 'Menyenangi sesuatu berhubungan dengan Benda-Benda Luar Angkasa, seperti: planet,\r\nmeteor, UFO, bulan, matahari, bintang, galaksi tercermin kegiatan membaca, berdiskusi, bereksperimen\r\nmaupun melakukan penelitian.', '846cef57-7077-3e83-b838-eb421192dce8');
INSERT INTO `soal_tmi` VALUES (90, 88, '<ul><li>Berkunjung ke sebuah negara tertentu. </li><li>Senang dengan benda-benda dari negara tertentu. </li><li>Menghadiri festival kebudayaan suatu negara tertentu</li></ul>', 'ILMU_SOSIAL', 'KEBUDAYAAN ASING', 'Menyenangi Kebudayaan Suatu Negara, tercermin kegiatan menyenangi pola\r\nhidup, pakaian, seni, benda-benda khas maupun tradisi negara tersebut; senang berdiskusi tentang\r\nkebudayaan negara tersebut.', '79e048ad-85db-3716-99d2-70338f4e9e8b');
INSERT INTO `soal_tmi` VALUES (91, 89, '<ul><li>Menjadi notulen suatu kegiatan. </li><li>Mengikuti pelatihan surat menyurat. </li><li>Mempelajari cara membuat proposal untuk suatu kegiatan.</li></ul>', 'ILMU_SOSIAL', 'SEKRETARIS', 'Menyenangi kegiatan berhubungan dengan kesektariatan, seperti: Pembuatan Surat\r\nMenyurat, Pembuatan Proposal, menjadi notulen dalam suatu kegiatan serta bersedia menjadi sekretaris\r\npada sebuah kegiatan/acara', 'c12b4bc5-0b1d-3db0-a92d-896b1dfcc1ca');
INSERT INTO `soal_tmi` VALUES (92, 90, '<ul><li>Senang melukis sesuatu</li><li>Tim pembuat patung dari bongkahan es. </li><li>Membuat pot, guci, atau benda lain dari tanah liat.</li></ul>', 'ILMU_SOSIAL', 'SENI RUPA MURNI', 'Menyenangi kegiatan berhubungan dengan Seni Rupa Murni, seperti: melukis,\r\nmembuat patung, membuat benda dari bongkahan es meliputi kegiatan mempelajari, berdiskusi, maupun\r\nmengerjakan benda rupa', '97bf8523-b4a9-379a-a020-948688d3af4b');
INSERT INTO `soal_tmi` VALUES (93, 91, '<ul><li>Tim pembuat antibiotik unggas. </li><li>Menghadiri pelatihan memilih makanan ternak bergizi. </li><li>Mempelajari cara pengembangbiakan ikan, cumi, dan kepiting.&nbsp;</li></ul>', 'ILMU_ALAM', 'PETERNAKAN', 'Menyenangi sesuatu berhubungan dengan Peternakan, seperti: pakan, antibiotik,\r\nkandang maupun pengembangbiakan hewan ternak tercermin kegiatan mempelajari, melakukan eksperimen,\r\nberdiskusi, penelitian ilmiah.', '9f62bd1c-5981-3995-b39d-1f56bf3da2bf');
INSERT INTO `soal_tmi` VALUES (94, 92, '<ul><li>Tim yang mengobati hewan yang sakit. </li><li>Mempelajari cara merawat hewan dengan baik. </li><li>Menghadiri seminar mengenali penyakit hewan peliharaan.</li></ul>', 'ILMU_ALAM', 'KEDOKTERAN HEWAN', 'Menyenangi sesuatu berhubungan dengan Kesehatan Hewan, tercermin pada\r\nkegiatan mengenali, mencegah maupun mengobati penyakit suatu hewan – mengetahui alat-alat kedokteran\r\nhewan tersebut.', '407007c5-f098-38b9-9c1d-11a1aaa5eab0');
INSERT INTO `soal_tmi` VALUES (95, 93, '<ul><li>Memiliki cita-cita menjadi pilot. </li><li>Mengikuti pelatihan mengendarai helikopter. </li><li>Senang diajak keliling Indonesia dengan pesawat</li></ul>', 'ILMU_ALAM', 'PILOT', 'Menyenangi kegiatan yang berhubungan dengan Pilot tercermin pada mempelajari cara\r\nmengendarai pesawat atau helikopter, memiliki cita-cita menjadi pilot serta mau berkeliling Indonesia atau\r\ndunia dengan pesawat.', '76f329ca-6e55-3dfa-8360-3445c6f5d922');
INSERT INTO `soal_tmi` VALUES (96, 94, '<ul><li>Berniat menjadi pramugara/i. </li><li>Mempelajari pengelolaan maskapai. </li><li>Mengikuti pelatihan menjadi staf suatu penerbangan.</li></ul>', 'ILMU_SOSIAL', 'STAF PENERBANGAN', 'Menyenangi kegiatan yang berhubungan dengan Pendukung Kegiatan\r\nPenerbangan, seperti: Pramugari (a), bisnis travel/penerbangan, staff operasional pesawat, maupun kegiatan\r\noperasional penerbangan.', '75c58496-a13b-3013-8aa8-4ad8ba7e15a7');
INSERT INTO `soal_tmi` VALUES (97, 95, '<ul><li>Senang memasak suatu makanan.</li><li> Bersedia diminta untuk menata hidangan. </li><li>Mengikuti pelatihan membuat berbagai minuman.</li></ul>', 'ILMU_SOSIAL', 'TATA BOGA', 'Menyenangi sesuatu berhubungan dengan Tata Hidangan Makanan-Minuman -\r\nBagaimana membuat makanan-minuman yang lezat, bergizi dan menarik serta menyajikan dengan tata letak\r\nyang enak dipandang oleh mata.', '863836bf-a64d-34f4-8bdf-dfd0e0f67f52');
INSERT INTO `soal_tmi` VALUES (98, 96, '<ul><li>Senang menjahit. </li><li>Bisa memperbaiki pakaian yang rusak. </li><li>Mengikuti pelatihan membuat motif pakaian.</li></ul>', 'ILMU_SOSIAL', 'MENJAHIT', 'Menyenangi kegiatan berhubungan dengan Penjahitan suatu pakaian baik itu menjahit\r\nlangsung, membordir maupun memperbaiki pakaian yang rusak tercermin dalam diskusi, mempelajari,\r\nmelakukan kegiatan penjahitan', '86184909-7ccf-34c9-bbc2-775f458e42b6');
INSERT INTO `soal_tmi` VALUES (99, 97, '<ul><li>Senang membuat desain suatu busana.</li><li>Menghadiri pelatihan membuat corak pakaian. </li><li>Memberikan rekomendasi tentang pakaian yang cocok dipakai seseorang.&nbsp;</li></ul>', 'ILMU_SOSIAL', 'TATA BUSANA', 'Menyenangi sesuatu berhubungan dengan Tata Busana - bagaimana mendesain pakaian\r\nuntuk orang, waktu, acara, situasi tertentu tercermin dalam mempelajari, memberi rekomendasi, berdiskusi\r\nmaupun mendesainnya.', 'c8ea0b43-4627-3b63-b47f-c7d6172d8cbd');
INSERT INTO `soal_tmi` VALUES (100, 98, '<ul><li>Senang mendandani seseorang. </li><li>Mengikuti pelatihan tata rias pengantin. </li><li>Bisa memberikan rekomendasi make up bagi orang-orang.&nbsp;</li></ul>', 'ILMU_SOSIAL', 'TATA RIAS', 'Menyenangi sesuatu berhubungan dengan Tata Rias bagi bagi orang, waktu, maupun\r\nkegiatan tertentu tercermin pada kegiatan seperti: mendandan, make up, bisa memberikan rekomendasi tata\r\nrias, mengenali alat-alat rias.', '0ab315a5-0ed6-3e29-a11c-5d64640957f5');
INSERT INTO `soal_tmi` VALUES (101, 99, '<ul><li>Membuat kerajinan tangan tertentu. </li><li>Senang diajak untuk membuat anyaman bambu. </li><li>Mengikuti pelatihan tentang memanfaatkan benda yang tidak dipakai.</li></ul>', 'ILMU_SOSIAL', 'KERAJINAN TANGAN', 'Menyenangi berhubungan dengan proses pembuatan benda-benda menjadi\r\nKerajinan Tangan dari berbagai bahan yang tersedia di alam untuk dijadikan tas, pot, mangkok, gelang,\r\ncincin, hiasan dinding, kursi, dll', '3192242f-b2c7-3f4a-bd2d-8a95d27bfaba');
